/**
 * @class
 * @extends Colibri.UI.Component
 * @memberof Colibri.UI.List
 */
Colibri.UI.List.Item = class extends Colibri.UI.Component {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {HTMLElement|Colibri.UI.Component} container container of component 
     */
    constructor(name, container) {
        super(name, container);

        this.AddClass('app-component-list-item');

        this.AddHandler('Clicked', this.__ItemSelected);
        this.AddHandler('DoubleClicked', this.__ItemDblSelected);
        this.AddHandler('MouseDown', this.__ItemMouseDown);
        this.AddHandler('MouseUp', (event, args) => this.list?.Dispatch('ItemMouseUp', args));

        this.AddHandler('ContextMenuIconClicked', (event, args) => this.group.Dispatch('ContextMenuIconClicked', Object.assign({item: this}, args)));
        this.AddHandler('ContextMenuItemClicked', (event, args) => this.group.Dispatch('ContextMenuItemClicked', Object.assign({item: this}, args)));

    }


    /**
     * Is item selected 
     * @type {boolean} 
     */
    get selected() {
        return this._element.is('.app-component-selected');
    }

    /**
     * Is item selected 
     * @type {boolean} 
     */
    set selected(value) {
        if (value) {
            this.AddClass('app-component-selected');
            // this._element.ensureInViewport(this.list?.container ?? document.body);
        } else {
            this.RemoveClass('app-component-selected');
        }
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __ItemSelected(event, args) {
        this.list.Dispatch('ItemClicked', Object.assign(args, {item: this, domEvent: args.domEvent}));
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __ItemDblSelected(event, args) {
        this.list.Dispatch('ItemDoubleClicked', {item: this, domEvent: args.domEvent});
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __ItemMouseDown(event, args) {
        if(this.list) {
            this.list.selected = this;
            this.list?.Dispatch('ItemMouseDown', {item: this, domEvent: args.domEvent});
        }
    }

    /** 
     * Value object
     * @type {object}
     */
    get value() {
        return this._itemData;
    }

    /** 
     * Value object
     * @type {object}
     */
    set value(value) {

        const oldKey = String.MD5(JSON.stringify(Object.sortPropertiesRecursive(this._itemData)));
        const newKey = String.MD5(JSON.stringify(Object.sortPropertiesRecursive(value)));
        if(oldKey === newKey) {
            return;
        }

        this._itemData = value;
        
        let html = this._itemData?.title ?? '';
        if(this.list?.rendererComponent) {
            const attrs = this.list?.rendererAttrs ?? {};
            let content = this.Children(this._itemData?.name ?? this.name + '_renderer');
            if(!content) {
                let comp = typeof(this.list.rendererComponent) === 'string' ? this.list.rendererComponent : this.list.rendererComponent(this._itemData, this);
                if(!(comp instanceof Colibri.UI.Component)) {
                    comp = eval(comp);
                }
                content = new comp(this._itemData?.name ?? this.name + '_renderer', this);
                content.shown = true;
                delete attrs.name;
                Object.forEach(attrs, (key, value) => {
                    content[key] = value;
                });
            }
            if(attrs?.render) {
                content[attrs?.render] = this._itemData;
            } else {
                content.value = this._itemData;
            }
            html = null;
        } else if(this.list?.__renderItemContent) {
            html = this.list.__renderItemContent(this._itemData, this);
        }
        else if(this._itemData?.__render) {
            html = this._itemData.__render.apply(this, [this._itemData, this]);
        }
        
        if(html) {
            this._element.html(html);
        }

        let data = Object.assign({}, this._itemData);
        delete data.__render;

        this._element.tag(data);
    }

    /** 
     * Context menu items
     * @type {Array}
     */
    get contextmenu() {
        return this.group.contextmenu;
    }

    /** 
     * Context menu items
     * @type {Array}
     */
    set contextmenu(items) {
        this.group.contextmenu = items;
    }

    /**
     * Key value
     * @type {string}
     */
    get key() {
        return this._key;
    }
    /**
     * Key value
     * @type {string}
     */
    set key(value) {
        this._key = value;
    }

    /**
     * List associated by item
     * @type {Colibri.UI.List}
     * @readonly
     */
    get list() {
        return this.group?.parent ?? null;
    }

    /**
     * List group associated by item
     * @type {Colibri.UI.List.Group}
     * @readonly
     */
    get group() {
        return this.parent?.parent ?? null;
    }

}

/**
 * @class
 * @namespace
 * @extends Colibri.UI.Component
 * @memberof Colibri.UI
 */
Colibri.UI.Tree = class extends Colibri.UI.Component {

    /** @type {Colibri.UI.TreeNode|null} */
    _selected = null;

    /**
     * @constructor
     * @param {string} name name of component
     * @param {HTMLElement|Colibri.UI.Component} container container of component 
     */
    constructor(name, container) {
        super(name, container, Element.create('div'));

        this._allNodes = new Set();

        this._nodes = new Colibri.UI.TreeNodes('nodes', this, this);
        this.AddClass('app-ui-tree-component');

        this._handleEvents();
    }

    /** @protected */
    _registerEvents() {
        super._registerEvents();
        this.RegisterEvent('NodeExpanded', false, 'Поднимается, когда ветка дерева раскрывается');
        this.RegisterEvent('NodeCollapsed', false, 'Поднимается, когда ветка дерева закрывается');
        this.RegisterEvent('SelectionChanged', false, 'Поднимается, когда ментяется выбранный элемент');
        this.RegisterEvent('NodeEditCompleted', false, 'Поднимается, когда заканчивается редактирование узла');
        this.RegisterEvent('NodeClicked', false, 'Поднимается, когда ткнули в узел');
        this.RegisterEvent('CheckChanged', false, 'When node checkbox is changed');
    }

    /** @protected */
    _handleEvents() {
        this.AddHandler('Clicked', (sender, args) => {
            this.ClearSelection();
            this.Dispatch('SelectionChanged', {node: null});
        });
    }

    /** 
     * Tree nodes object
     * @type {Colibri.UI.TreeNodes} 
     */
    get nodes() {
        return this._nodes;
    }

    /**
     * Searches for nodes
     * @param {string} term term to search in nodes
     * @param {boolean} asAjar return nodes ajar
     */
    Search(term, asAjar = false) {
        if(!term) {
            this.allNodes.forEach((node) => node.Show());    
        }
        else {
            this.allNodes.forEach((node) => {
                if(node.text.toLowerCase().indexOf(term.toLowerCase()) === -1) {
                    node.Hide();
                }
                else {
                    let p = node.parentNode;
                    while(p) {
                        p.Show();
                        p = p.parentNode;
                    }
                    if(asAjar) {
                        node.ShowAll();
                    } else {
                        node.Show();
                    }
                }
            }); 
        }
        
    }

    /**
     * Expand all nodes
     */
    ExpandAll() {
        this.nodes.ForEach((nodeName, node) => {
            node.ExpandAll();
        })
    }

    /**
     * Collapse all nodes
     */
    CollapseAll() {
        this.nodes.ForEach((nodeName, node) => {
            node.CollapseAll();
        })
    }

    /**
     * Select node
     */
    Select(node) {
        this.ClearSelection();
        this._selected = node;
        if(node !== null) {
            node.selected = true;
        }
        this.Dispatch('SelectionChanged', {node: node});
    }

    /**
     * Clear selection on all nodes
     */
    ClearSelection() {
        this._element.querySelectorAll('.selected').forEach(selected => selected.classList.remove('selected'));
        this._selected = null;
    }

    /** 
     * Selected node
     * @type {Colibri.UI.TreeNode} 
     */
    get selected() {
        return this._selected;
    }

    /** 
     * Selected node
     * @type {Colibri.UI.TreeNode} 
     */
    set selected(node) {
        if(typeof node === 'string') {
            node = this.FindByPath(node);
        }
        this.Select(node);
    }

    /**
     * Array of checks
     * @type {Array}
     */
    get checked() {
        return Array.from(this.allNodes).filter(v => v.checked == true);
    }
    /**
     * Array of checks
     * @type {Array}
     */
    set checked(value) {
        for(let v of value) {
            if(typeof v === 'string') {
                v = this.FindByPath(v);
            }
            v.checked = true;
        }
        
    }

    /**
     * All nodes set
     * @type {Set}
     */
    get allNodes() {
        return this._allNodes;
    }

    /**
     * Returns node by name or null
     * @param {string} name name of node
     * @returns {Colibri.UI.TreeNode|null}
     */
    FindNode(name) {
        for(const node of this._allNodes) {
            if(node.name == name) {
                return node;
            }
        }
        return null;
    }

    /**
     * Returns node by path or null
     * @param {string} nodePath nodePath of node
     * @returns {Colibri.UI.TreeNode|null}
     */
    FindByPath(nodePath) {
        nodePath = nodePath.split('/');
        let parent = this;
        for(const n of nodePath) {
            parent = parent.nodes.Children(n);
            if(!parent) {
                break;
            }
        }
        return parent;
    }

    /**
     * Is tree has context menu
     * @type {boolean}
     */
    get hasTreeContextMenu() {
        return this._hasTreeContextMenu;
    }

    /**
     * Is tree has context menu
     * @type {boolean}
     */
    set hasTreeContextMenu(value) {
        this._hasTreeContextMenu = value === true || value === 'true';
        this._createContextMenuButton();
    }

    /** @private */
    _createContextMenuButton() {
        if(!this._hasTreeContextMenu || !this._hasContextMenu || this.Children(this._name + '-contextmenu-icon-parent')) {
            return;
        }

        this.AddClass('app-component-hascontextmenu');

        const contextMenuParent = new Colibri.UI.Pane(this._name + '-contextmenu-icon-parent', this);
        contextMenuParent.parent = this;
        contextMenuParent.AddClass('app-contextmenu-icon-component');
        contextMenuParent.shown = true;
        this.Children(this._name + '-contextmenu-icon-parent', contextMenuParent);

        const contextMenuIcon = new Colibri.UI.Icon(this._name + '-contextmenu-icon', contextMenuParent);
        contextMenuIcon.shown = true;
        contextMenuIcon.value = Colibri.UI.ContextMenuIcon;
        contextMenuIcon.AddHandler('Clicked', (event, args) => this.Dispatch('ContextMenuIconClicked', args));    

        this.AddHandler('Scrolled', (event, args) => {
            contextMenuParent.container.css('bottom', (-1 * this.scrollTop + 10) + 'px');
        }); 
        this.Dispatch('Scrolled');

    }

    /** @private */
    _removeContextMenuButton() {
        if(this._hasTreeContextMenu && this._hasContextMenu && this.Children(this._name + '-contextmenu-icon-parent')) {
            this.Children(this._name + '-contextmenu-icon-parent').Dispose();
            this.RemoveClass('app-component-hascontextmenu');
        }
    }

    /**
     * Is tree is dropable
     * @type {boolean}
     */
    get dropable() {
        return this._dropable;
    }

    /**
     * Is tree is dropable
     * @type {boolean}
     */
    set dropable(value) {
        this._dropable = value;
    }

    /**
     * Is tree is draggable
     * @type {boolean}
     */    
    get draggable() {
        return this._draggable;
    }

    /**
     * Is tree is draggable
     * @type {boolean}
     */    
    set draggable(value) {
        this._draggable = value;
    }

    /**
     * Is tree is sortable
     * @type {boolean}
     */    
    get sorting() {
        return this._sorting;
    }

    /**
     * Is tree is sortable
     * @type {boolean}
     */    
    set sorting(value) {
        this._sorting = value;
        this._setSorting();
    }

    /** @private */
    _setSorting() {
        if(this._sorting) {
            this.AddClass('-sortable');
        }
        else {
            this.RemoveClass('-sortable');
        }
    }
    
    /**
     * Expand node on click
     * @type {Boolean}
     */
    get expandOnClick() {
        return this._expandOnClick;
    }
    /**
     * Expand node on click
     * @type {Boolean}
     */
    set expandOnClick(value) {
        this._expandOnClick = value === true || value === 'true';
    }

    /**
     * Value Array
     * @type {Array}
     */
    set value(value) {
        this.nodes.value = value;
    }

    /**
     * Value Array
     * @type {Array}
     */
    get value() {
        return this.nodes.value;
    }

    /**
     * Multiple selection
     * @type {Boolean}
     */
    get multiple() {
        return this._multiple;
    }
    /**
     * Multiple selection
     * @type {Boolean}
     */
    set multiple(value) {
        value = this._convertProperty('Boolean', value);
        this._multiple = value;
        this._showMultiple();
    }

    /** @private */
    _showMultiple() {
        Array.from(this.allNodes).map(node => node.multiple = this._multiple);
    }

    /**
     * Remove hidden nodes
     * @type {Boolean}
     */
    get removeHiddenNodes() {
        return this._removeHiddenNodes;
    }
    /**
     * Remove hidden nodes
     * @type {Boolean}
     */
    set removeHiddenNodes(value) {
        this._removeHiddenNodes = value;
    }

    /**
     * sets thrid or full state of parent checks  
     * @param {Colibri.UI.TreeNode} node node to check
     */
    PerformCheckState(node) {
        
        this._allNodes.forEach((n, index) => {

            if(n.nodes.children > 0) {
                if(n.nodes.allNodesChecked) {
                    n.checkBox.checked = true;
                    n.checkBox.thirdState = false;
                } else if(n.nodes.allNodesUnChecked)  {
                    n.checkBox.checked = false;
                    n.checkBox.thirdState = false;
                } else {
                    n.checkBox.checked = true;
                    n.checkBox.thirdState = true;
                }
            } 
        });

    }

}

/**
 * @class
 * @namespace
 * @extends Colibri.UI.Component
 * @memberof Colibri.UI
 */
Colibri.UI.TreeNode = class extends Colibri.UI.Component {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {HTMLElement|Colibri.UI.Component} container container of component 
     */
    constructor(name, container) {
        super(name, container, Element.fromHtml('<div><div><dd drop="before"></dd><em class="expander"></em><em class="check"></em><em class="icon none"></em><span></span><input type="text" /><dd drop="after"></dd><span class="node-tip"></span></div></div>')[0]);
        this._nodes = new Colibri.UI.TreeNodes('nodes', this, container.tree);

        this._div = this._element.querySelector(':scope > div');
        this._input = this._element.querySelector('input');
        this._text = this._element.querySelector('div span');
        this._tipSpan = this._element.querySelector(':scope > div > .node-tip');
        this._check = this._element.querySelector(':scope > div > .check');

        this._handleEvents();

        this.AddClass('node');
        this.Show();

        this.hasContextMenu = container.tree.hasContextMenu;
        this.dropable = this.tree.dropable;
        this.draggable = this.tree.draggable;
        this.isLeaf = true;

    }

    /** @protected */
    _createContextMenuButton() {
        if(!this._hasContextMenu || this.Children(this._name + '-contextmenu-icon-parent')) {
            return;
        }


        const container = this.container.querySelector('div');
        container.classList.add('app-component-hascontextmenu');

        const contextMenuParent = new Colibri.UI.Pane(this._name + '-contextmenu-icon-parent', container);
        contextMenuParent.parent = this;
        contextMenuParent.AddClass('app-contextmenu-icon-component');
        contextMenuParent.shown = true;
        this.Children(this._name + '-contextmenu-icon-parent', contextMenuParent);

        if(this._nodes.tree._recreateNodeIcon) {
            this._nodes.tree._recreateNodeIcon(this);
        }
        else {
            const contextMenuIcon = new Colibri.UI.Icon(this._name + '-contextmenu-icon', contextMenuParent);
            contextMenuIcon.shown = true;
            contextMenuIcon.value = Colibri.UI.ContextMenuIcon;
            contextMenuIcon.AddHandler('Clicked', (event, args) => this.parent.tree.Dispatch('ContextMenuIconClicked', Object.assign({item: this}, args)));    
        }
        
    }

    /** @protected */
    _removeContextMenuButton() {
        if(this._hasContextMenu && this.Children(this._name + '-contextmenu-icon-parent')) {
            this.Children(this._name + '-contextmenu-icon-parent').Dispose();
            this.container.querySelector('div').classList.remove('app-component-hascontextmenu');
        }
    }

    /** @protected */
    _registerEvents() {
        super._registerEvents();
        this.RegisterEvent('Expanded', false, 'When node is expanded');
        this.RegisterEvent('Collapsed', false, 'When node is collapsed');
        this.RegisterEvent('CheckChanged', false, 'When multiple check changed');
    }

    /** @protected */
    _handleEvents() {
        this.AddHandler('Clicked', (sender, args) => {
            if(this._element.querySelector('div>em.expander') === args.domEvent.target) {
                this.expanded = !this.expanded;
            } else {
                if(this._nodes.tree.Dispatch('NodeClicked', Object.assign({item: this}, args)) !== false) {
                    this._nodes.tree.Select(this);
                }
                if(this.tree.expandOnClick) {
                    this.expanded = true;
                }
            }
            args.domEvent.stopPropagation();
            return false;
        });

        this.AddHandler('ContextMenuItemClicked', (event, args) => this._nodes.tree.Dispatch('ContextMenuItemClicked', Object.assign({item: this}, args)));
        this.AddHandler('DoubleClicked', (event, args) => {
            
            if(this._editable) {
                this.__nodeEditableStart(event, args);
            }
            else {
                this._nodes.tree.Dispatch('DoubleClicked', Object.assign({item: this}, args));
            }
            
            args.domEvent.stopPropagation();
            args.domEvent.preventDefault();
            return false;
        });

    }

    /** @protected */
    _bindHtmlEvents() {
        super._bindHtmlEvents();
    }

    /**
     * Ensures node is visible
     */
    EnsureVisible() {
        let parent = this.parentNode;
        while(parent) {
            this.parentNode.Expand();
            parent = parent.parentNode;
        }
        super.EnsureVisible();
    }

    /**
     * Disposes the node and its children
     */
    Dispose() {
        
        try {
            this.tree.allNodes.delete(this);
        }
        catch(e) {}
        
        const node = this.parentNode;
        this._nodes.Dispose();
        super.Dispose();

        try {
            if(node instanceof Colibri.UI.TreeNode) {
                node.isLeaf = this.parent.children == 0;
            }    
        }
        catch(e) {}

    }

    /**
     * Tooltip text
     * @type {string}
     */
    get toolTip() {
        return this._tipSpan.html();
    }
    /**
     * Tooltip text
     * @type {string}
     */
    set toolTip(value) {
        this._tipSpan.html(value);
    }

    /**
     * Node is expanded
     * @type {boolean}
     */
    get expanded() {
        return this._element.classList.contains('expanded');
    }

    /**
     * Node is expanded
     * @type {boolean}
     */
    set expanded(value) {
        if(value) {
            this._element.classList.add('expanded');
            if(this.tree.removeHiddenNodes) {
                this.nodes.Retreive();
            } 
            this.Dispatch('Expanded', {node: this._element});
        }
        else {
            this._element.classList.remove('expanded');
            if(this.tree.removeHiddenNodes) {
                this.nodes.KeepInMind();
            }
            this.Dispatch('Collapsed', {node: this._element});
        }
    }

    /**
     * Node is expanded
     * @type {Colibri.UI.TreeNodes}
     */
    get nodes() {
        return this._nodes;
    }

    /**
     * Node text
     * @type {string}
     */
    get text() {
        return this._text.html();
    }

    /**
     * Node text
     * @type {string}
     */
    set text(value) {
        this._text.html(value);
    }

    /**
     * Node is leaf
     * @type {boolean}
     */
    get isLeaf() {
        return this._element.classList.contains('is-leaf');
    }

    /**
     * Node is leaf
     * @type {boolean}
     */
    set isLeaf(value) {
        if (value) {
            if(this._multiple && this._checkBox) {
                this._checkBox.hasThirdState = false;
            }
            this._element.classList.add('is-leaf');
        } else {
            if(this._multiple && this._checkBox) {
                this._checkBox.hasThirdState = true;
            }
            this._element.classList.remove('is-leaf');
        }
    }

    /**
     * Node icon
     * @type {string}
     */
    get icon() {
        return this._element.querySelector('div em.icon').html();
    }

    /**
     * Node icon
     * @type {string}
     */
    set icon(value) {
        this._element.querySelector('div em.icon').html(value);
    }

    /**
     * Node is selected
     * @type {boolean}
     */
    get selected() {
        this._element.querySelector('div').classList.add('selected');
    }

    /**
     * Node is selected
     * @type {boolean}
     */
    set selected(value) {
        if(value) {
            this._element.querySelector('div').classList.add('selected');
        }
        else {
            this._element.querySelector('div').classList.remove('selected');
        }
    }

    /**
     * Node path
     * @type {string}
     * @readonly
     */
    get path() {
        return super.path.replaceAll('nodes/', '');
    }

    /**
     * Parent node
     * @type {Colibri.UI.TreeNode}
     */
    get parentNode() {
        return this?.parent?.parent ?? null;
    }

    /**
     * Parent node
     * @type {Colibri.UI.TreeNode}
     */
    set parentNode(value) {
        const node = this.parentNode;
        
        this.parent.Children(this.name, null);
        this.Disconnect();
        value.nodes.Children(this.name, this);
        this.ConnectTo(value.nodes.container);

        value.isLeaf = false;
        node.isLeaf = node.nodes.children == 0;
    }

    /**
     * Searches for node with search method
     * @param {Function} method method to compare node
     * @returns {Colibri.UI.TreeNode}
     */
    FindParent(method) {
        let p = this;
        while(p instanceof Colibri.UI.TreeNode) {
            if(method(p)) {
                return p;
            }
            p = p.parentNode;
        }
        return null;
    }

    /**
     * Move to new parent node
     * @param {Colibri.UI.TreeNode} parent new parent node
     */
    MoveTo(parent) {
        this.parentNode = parent;
    }

    /**
     * Expand node
     */
    Expand() {
        this.expanded = true;
    }

    /**
     * Collapse node
     */
    Collapse() {
        this.expanded = false;
    }

    /**
     * Expand all child nodes
     */
    ExpandAll() {
        this.Expand();
        this.nodes.Expand();
    }

    /**
     * Collapse all child nodes
     */
    CollapseAll() {
        this.Collapse();
        this.nodes.Collapse();
    }

    /**
     * Run editor of node
     */
    Edit() {
        this.tree.selected = this;
        this.__nodeEditableStart(null, null);
    }

    /**
     * Shows all child nodes and itself
     */
    ShowAll() {
        this.Show();
        const childs = this.Children();
        for(const child of childs) {
            child.ShowAll();
        }        
    }

    /**
     * Hides all child nodes and itself
     */
    HideAll() {
        this.Hide();
        const childs = this.Children();
        for(const child of childs) {
            child.HideAll();
        }        
    }

    /**
     * Tree component
     * @type {Colibri.UI.Tree}
     * @readonly
     */
    get tree() {
        return this?.parent?.tree;
    }

    /**
     * Is node editable
     * @type {boolean}
     */
    get editable() {
        return this._editable;
    }

    /**
     * Is node editable
     * @type {boolean}
     */
    set editable(value) {
        this._editable = value;
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __nodeEditableStart(event, args) {
        if(!this._editable) {
            return true;
        }

        this.AddClass('editing');
        this._input.value = this.text;
        this._input.focus();
        this._input.select();
        const keydownHandler = (e) => {
            if(e.code == 'Enter' || e.code == 'NumpadEnter') {
                if(this.tree.Dispatch('NodeEditCompleted', {value: this._input.value, node: this, mode: 'save'})) {
                    this.text = this._input.value;
                }
                this.RemoveClass('editing');
                this._input.removeEventListener('keydown', keydownHandler);
                this._input.removeEventListener('blur', blurHandler);
            }
            else if(e.code == 'Escape') {
                this.tree.Dispatch('NodeEditCompleted', {value: this.text, node: this, mode: 'cancel'});
                this.RemoveClass('editing');
                this._input.removeEventListener('keydown', keydownHandler);
                this._input.removeEventListener('blur', blurHandler);
            }
        }
        const blurHandler = (e) => {
            this.tree?.Dispatch('NodeEditCompleted', {value: this.text, node: this, mode: 'cancel'});
            this.RemoveClass('editing');
            this._input.removeEventListener('keydown', keydownHandler);
            this._input.removeEventListener('blur', blurHandler);
        }
        this._input.addEventListener('keydown', keydownHandler);
        this._input.addEventListener('blur', blurHandler);
    }

    /**
     * Multiple
     * @type {Boolean}
     */
    get multiple() {
        return this._multiple;
    }
    /**
     * Multiple
     * @type {Boolean}
     */
    set multiple(value) {
        value = this._convertProperty('Boolean', value);
        this._multiple = value;
        if(this._multiple) {
            this._check.showElement();   
            if(!this._checkBox) {
                this._checkBox = new Colibri.UI.Checkbox('checkbox', this._check);
                this._checkBox.parent = this;
                this._checkBox.shown = true;
                this._checkBox.AddHandler('Changed', (event, args) => this.__checkChanged(event, args));
            }
        } else {
            this._check.hideElement();
            if(this._checkBox) {
                this._checkBox.Dispose();
                this._checkBox = null;
            }
        }
    }

    /**
     * Checked
     * @type {Boolean}
     */
    get checked() {
        return this._checkBox ? this._checkBox.checked : false;
    }
    /**
     * Checked
     * @type {Boolean}
     */
    set checked(value) {
        value = this._convertProperty('Boolean', value);
        if(this._checkBox) {
            this._checkBox.checked = value;
            if(!this.isLeaf) {
                this.nodes.ForEach((name, node) => {
                    node.checkBox.checked = this._checkBox.checked;
                });
            }
            this.tree.PerformCheckState(this);
        }
    }

    /**
     * Checkbox of node
     * @type {Colibri.UI.Checkbox}
     * @readonly
     */
    get checkBox() {
        return this._checkBox;
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __checkChanged(event, args) {
        if(!this.isLeaf) {
            this.nodes.ForEach((name, node) => {
                node.checkBox.checked = this._checkBox.checked;
            });
        }
        this.tree.PerformCheckState(this);
        this.tree.Dispatch('CheckChanged', args);
    }


}

/**
 * @class
 * @namespace
 * @extends Colibri.UI.Component
 * @memberof Colibri.UI
 */
Colibri.UI.TreeNodes = class extends Colibri.UI.Component {

    /** @type {Colibri.UI.Tree} */
    _tree = null;

    /**
     * @constructor
     * @param {string} name name of component
     * @param {HTMLElement|Colibri.UI.Component} container container of component 
     */
    constructor(name, container, tree) {
        super(name, container, Element.create('div'));
        this._tree = tree;

        this.AddClass('nodes');
        this.Show();
        

    }

    /**
     * Adds a new node to nodes collection 
     * @param {string} name name of new node
     * @param {number} index index of new node
     * @returns {Colibri.UI.TreeNode}
     */
    Add(name, index) {
        let node = null;
        if(name instanceof Colibri.UI.TreeNode) {
            node = name;
        }
        else {
            node = new Colibri.UI.TreeNode(name || 'node', this);
            node.AddHandler('Expanded', (event, args) => { return this._tree.Dispatch('NodeExpanded', {node: event.sender}); });
            node.AddHandler('Collapsed', (event, args) => { return this._tree.Dispatch('NodeCollapsed', {node: event.sender}); });    
        }

        if(this.parent instanceof Colibri.UI.TreeNode) {
            this.parent.isLeaf = false;
        }
        this._tree.allNodes.add(node);
        if(index != node.childIndex) {
            this.Children(name, node, index);
        }

        if(this._tree.multiple) {
            node.multiple = this._tree.multiple;
        }

        return node;
    }

    /**
     * Move node before relation node
     * @param {Colibri.UI.TreeNode} node node to move
     * @param {Colibri.UI.TreeNode} relation node for moving relation
     */
    Move(node, relation) {

        let index = relation;
        if(relation instanceof Colibri.UI.TreeNode) {
            this.ForEach((name, n, i) => {
                if(relation.name == name) {
                    index = i;
                    return false;
                }
                return true;
            });
        }

        this.Children(node.name, node, index);


    }

    /**
     * Dispose nodes collection
     */
    Dispose() {
        if(this.parent instanceof Colibri.UI.TreeNode) {
            this.parent.isLeaf = true;
        }
        this.ForEach((nodeName, node) => {
            node.Dispose();
        });
        super.Dispose();
    }

    /**
     * Tree related to nodes collection
     * @type {Colibri.UI.Tree}
     * @readonly
     */
    get tree() {
        return this._tree;
    }

    /**
     * Expand nodes
     */
    Expand() {
        this.ForEach((nodeName, node) => {
            node.ExpandAll();
        })
    }

    /**
     * Collapse nodes
     */
    Collapse() {
        this.ForEach((nodeName, node) => {
            node.Collapse();
        })
    }

    /**
     * Has visible nodes
     * @type {Boolean}
     * @readonly
     */
    get hasVisibleNodes() {
        return this.visibleNodesCount > 0
    } 

    /**
     * Visible nodes count
     * @type {Number}
     * @readonly
     */
    get visibleNodesCount() {
        let visibleNodes = 0;
        this.ForEach((name, node) => {
            if(node.shown) {
                visibleNodes++;
            }
        });
        return visibleNodes;
    }

    /**
     * Value Array
     * @type {Array}
     */
    set value(value) {
     
        if(!Array.isArray(value)) {
            value = Object.values(value);
        }

        this.Clear();

        for(const vnode of value) {
            const node = this.Add('node' + vnode.id);
            node.text = this.tree.__renderText ? this.tree.__renderText(vnode) : vnode?.name ?? vnode?.title ?? 'Node ' + vnode.id;
            node.tag = vnode;
            if(vnode.children) {
                node.nodes.value = vnode.children;
            }
        }
        
    }

    /**
     * Is all nodes checked
     * @readonly
     */
    get allNodesChecked() {

        let checked = 0;
        this.ForEach((name, node) => {
            if(node.checked) {
                checked++;
            }
        });

        return checked === this.children;

    }

    /**
     * Is all nodes unchecked
     * @readonly
     */
    get allNodesUnChecked() {

        let checked = 0;
        this.ForEach((name, node) => {
            if(node.checked) {
                checked++;
            }
        });

        return checked === 0;

    }

}



/**
 * @class
 * @extends Colibri.UI.Renderer
 * @memberof Colibri.UI.Tree
 */
Colibri.UI.Tree.JsonRenderer = class extends Colibri.UI.Renderer {

    /**
     * Render data in renderer as nodes
     */
    Render() {

        this._data = Object.values(this._data);
        this._data.forEach((node) => {

            const n = this._object.nodes.Add(node.permission)
            n.text = node.title;

            if(node.children && Object.countKeys(node.children) > 0) {
                Colibri.Common.Delay(100).then(() => {
                    const renderer = new Colibri.UI.Tree.JsonRenderer(n, node.children);
                    renderer.Render();
                });
            }
            else {
                n.isLeaf = true;
            }

        });

    }
}
/**
 * @class
 * @extends Colibri.UI.Renderer
 * @memberof Colibri.UI.List
 */
Colibri.UI.List.JsonRenderer = class extends Colibri.UI.Renderer {

    /**
     * Render data in renderer as list items
     */
    Render() {

        this._data = Object.values(this._data);
        this._data.forEach((grp) => {

            const group = this._object.AddGroup(grp.name, grp.label);
            group.tag = group;
            grp.children && grp.children.forEach((itm) => {
                const item = group.AddItem(itm);
                item.tag = itm;
            });

        });

    }
}

/**
 * @class
 * @extends Colibri.UI.Component
 * @memberof Colibri.UI
 */
Colibri.UI.Color = class extends Colibri.UI.Component {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     */
    constructor(name, container) {
        super(name, container, Element.create('div'));
        this.AddClass('app-color-component');

        this.RegisterEvent('Changed', false, 'Когда значение изменилось');

        this._colorGrad = new Colibri.UI.Color.Line(this.name + '_grad', this);

        this._colorSelectedColorGrad = new Colibri.UI.Color.Block(this.name + '_block', this);

        this._colorOpacityGrad = new Colibri.UI.Color.Alpha(this.name + '_alpha', this);

        this._colorHex = Element.create('input', {class: 'app-color-hex-component'});
        this._colorSelected = Element.create('div', {class: 'app-color-selected-component'});

        this._element.append(this._colorHex);
        this._element.append(this._colorSelected);

        this._colorGrad.shown = true;
        this._colorSelectedColorGrad.shown = true;
        this._colorOpacityGrad.shown = true;

        this._colorGrad.AddHandler('Changed', (event, args) => this.__lineValueChanged(event, args));
        this._colorSelectedColorGrad.AddHandler('Changed', (event, args) => this.__blockValueChanged(event, args));
        this._colorOpacityGrad.AddHandler('Changed', (event, args) => this.__opacityValueChanged(event, args));

        this._colorHex.addEventListener('change', (e) => {
            this.value = this._colorHex.value;
        });

        this.handleVisibilityChange = true;
        this.AddHandler('VisibilityChanged', (event, args) => {
            const bounds = this.parent.container.bounds(true, true);
            if(!args.state) {
                this.top = null;
                this.bottom = (window.innerHeight - bounds.top);
            }
        });

    }

    /** @private */
    _updateUIComponents() {
        this._colorGrad.value = this._value.hue;
        this._colorSelectedColorGrad.value = this._value;
        this._colorOpacityGrad.value = this._value.alpha;
    }

    /** @private */
    _showValue() {
        this._colorHex.value = this._value.hex;
        this._colorSelected.css('background-color', this._colorHex.value);
        this.Dispatch('Changed');
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __lineValueChanged(event, args) {
        const alpha = this._value.alpha;
        this._colorSelectedColorGrad.color = this._colorGrad.value;
        this._value = this._colorSelectedColorGrad.value;
        this._value.alpha = alpha;
        this._showValue();
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __blockValueChanged(event, args) {
        const alpha = this._value.alpha;
        this._value = this._colorSelectedColorGrad.value;
        this._value.alpha = alpha;
        this._showValue();
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __opacityValueChanged(event, args) {
        this._value.alpha = this._colorOpacityGrad.value;
        this._showValue();
    }

    /**
     * Focus on component hex input
     */
    Focus() {
        this._colorHex.focus();
    }
    
    /**
     * Is component readonly
     * @type {boolean}
     */
    get readonly() {
        return this._colorHex.attr('readonly') === 'readonly';
    }

    /**
     * Is component readonly
     * @type {boolean}
     */
    set readonly(value) {
        if(value === true || value === 'true') {
            this._colorHex.attr('readonly', 'readonly');
        }
        else {
            this._colorHex.attr('readonly', null);
        }
    }

    /**
     * Component placeholder
     * @type {string}
     */
    get placeholder() {
        return this._colorHex.attr('placeholder');
    }

    /**
     * Component placeholder
     * @type {string}
     */
    set placeholder(value) {
        this._colorHex.attr('placeholder', value ? value[Lang.Current] ?? value : '');
    }

    /**
     * Component value
     * @type {string}
     */
    get value() {
        let value = this._value;
        if(this._fieldData?.params?.emptyAsNull && !value) {
            value = null;
        }
        if(this._fieldData?.params?.eval) {
            value = eval(this._fieldData?.params?.eval);
        }
        return value;
    }

    /**
     * Component value
     * @type {string}
     */
    set value(value) {
        if(typeof value == 'string') {
            this._value = Colibri.UI.Rgb.Create().fromHex(value);
        }
        else if(typeof value == 'number') {
            this._value = Colibri.UI.Rgb.Create().fromHue(value);
        }
        else if(value instanceof Colibri.UI.Rgb) {
            this._value = value;
        }
        else if(Object.isObject(value)) {
            this._value = Colibri.UI.Rgb.Create().fromObject(value);
        }
        this._updateUIComponents();
        this._showValue();
    }
    
    /**
     * Is component enabled
     * @type {boolean}
     */
    get enabled() {
        return this._colorHex.attr('disabled') != 'disabled';
    }

    /**
     * Is component enabled
     * @type {boolean}
     */
    set enabled(value) {
        if(value) {
            this.RemoveClass('app-component-disabled');
            this._colorHex.attr('disabled', null);
        }
        else {
            this.AddClass('app-component-disabled');
            this._colorHex.attr('disabled', 'disabled');
        }
    }

    /**
     * Tab index
     * @type {number}
     */
    get tabIndex() {
        return this._colorHex && this._colorHex.attr('tabIndex');
    }

    /**
     * Tab index
     * @type {number}
     */
    set tabIndex(value) {
        this._colorHex && this._colorHex.attr('tabIndex', value === true ? Colibri.UI.tabIndex++ : value);
    }


}
/**
 * @class
 * @extends Colibri.UI.Component
 * @memberof Colibri.UI
 */
Colibri.UI.Color.Line = class extends Colibri.UI.Component {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     */
    constructor(name, container) {
        super(name, container, Element.create('div'));
        this.AddClass('app-color-line-component');

        this.RegisterEvent('Changed', false, 'Когда значение изменилось');

        this._canvas = new Colibri.UI.Component(this.name + '_canvas', this, Element.create('canvas'));
        this._canvas.AddClass('app-color-line-canvas-component');
        this._canvas.shown = true;

        this._pointer = new Colibri.UI.Pane(this.name + '_pointer', this);
        this._pointer.AddClass('app-color-line-pointer-component');
        this._pointer.shown = true;

        this.AddHandler('Clicked', (event, args) => this.__lineClicked(event, args));
        this.handleResize = true;
        this.AddHandler('Resized', (event, args) => this._renderGradient());
        this.tabIndex = 0;
        this.AddHandler('KeyDown', (event, args) => this.__keyDown(event, args));

        new Colibri.UI.Drag(this._pointer.container, this.container, (left, top) => {
            this._pointer.styles = {left: left + 'px'};
            this._setNewValue(left);            
        });

        Colibri.Common.Delay(100).then(() => {
            this._renderGradient();
        });
        
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __keyDown(event, args) {
        if(['ArrowLeft', 'ArrowRight'].indexOf(args.domEvent.code) !== -1) {
            if(args.domEvent.code == 'ArrowLeft') {
                this.value += 0.01;
            }
            else if(args.domEvent.code == 'ArrowRight') {
                this.value -= 0.01;
            }
        }
    }

    /**
     * Component width
     * @type {number}
     */
    set width(value) {
        super.width = value;
        this._renderGradient();
    }
    /**
     * Component width
     * @type {number}
     */
    set height(value) {
        super.height = value;
        this._renderGradient();
    }
    /** @private */
    _setNewValue(left) {
        left += 5;
        const bounds = this._element.bounds();
        let t = Math.round(left / (bounds.outerWidth / 360));
        t = Math.abs(t - 360);
        t = (t == 360) ? 0 : t;
        t = Math.round(t * 100 / 360) / 100;

        this.value = t;
        this.Dispatch('Changed', {value: this.value}); 
    }

    /** @private */
    _showValue() {
        let t = this.value;
        const bounds = this._element.bounds();
        const pointerBounds = this._pointer.container.bounds();

        // процент
        let left = bounds.outerWidth - ((t * 100) * bounds.outerWidth / 100);
        this._pointer.styles = {backgroundColor: Colibri.UI.Rgb.Create().fromHSV(t, 1, 1).hex, left: (left - pointerBounds.outerWidth / 2)  + 'px'};

    }

    /** @private */
    _renderGradient() {
        const bounds = this._element.bounds(); 
		const canva = this._canvas.container.getContext("2d");

		const gradient = canva.createLinearGradient(bounds.outerWidth, bounds.outerHeight / 2, 0, bounds.outerHeight);
	    const hue = [[255, 0, 0], [255, 255, 0], [0, 255, 0], [0, 255, 255], [0, 0, 255], [255, 0, 255], [255, 0, 0]];
		for (var i = 0; i <= 6; i++) {
			gradient.addColorStop(i * 1 / 6, 'rgb(' + hue[i][0] + ',' + hue[i][1] + ',' + hue[i][2] + ')');
		}

        canva.fillStyle = gradient;
		canva.fillRect(0, 0, bounds.outerWidth + 100, bounds.outerHeight * 100);
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __lineClicked(event, args) {
        const bounds = this._element.bounds();
        const e = args.domEvent;
        let left = e.pageX - bounds.left - 5;
        this._pointer.styles = {left: left + 'px'};
        this._setNewValue(left);
    }
    
    /**
     * Component value
     * @type {string}
     */
    get value() {
        return this._value;
    }
    /**
     * Component value
     * @type {string}
     */
    set value(value) {
        if(value <= 0) {
            value = 0;
        }
        if(value >= 1) {
            value = 1;
        }
        this._value = value;
        this._renderGradient();
        this._showValue();
    }

}
/**
 * @class
 * @extends Colibri.UI.Component
 * @memberof Colibri.UI
 */
Colibri.UI.Color.Block = class extends Colibri.UI.Component {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     */
    constructor(name, container) {
        super(name, container, Element.fromHtml('<div><div class="grad"></div></div>')[0]);
        this.AddClass('app-color-block-component');
        
        this._pointer = new Colibri.UI.Pane(this.name + '_pointer', this);
        this._pointer.AddClass('app-color-block-pointer-component');
        this._pointer.shown = true;

        this.RegisterEvent('Changed', false, 'Когда значение изменилось');

        new Colibri.UI.Drag(this._pointer.container, this.container, (left, top) => {
            this._setNewColor(left, top);     
        });

        this.AddHandler('Clicked', (event, args) => this.__blockClicked(event, args));

    }

    /** @private */
    _setNewColor(left, top) {
        this._setPoint(left, top);

        const bounds = this._element.bounds();

        left = left + this._pointer.container.bounds().outerWidth / 2;
        top = top + this._pointer.container.bounds().outerHeight / 2;

        let S = Math.ceil(left / (bounds.outerWidth / 100));
        let V = Math.ceil(Math.abs(top / (bounds.outerHeight / 100) - 100));

        this._S = S / 100;
        this._V = V / 100;

        this.Dispatch('Changed', {value: this.value});

    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __blockClicked(event, args) {
        const bounds = this._element.bounds();
        const pointBounds = this._pointer.container.bounds();
        const e = args.domEvent;
        let top = e.pageY - bounds.top - pointBounds.outerHeight / 2;
        let left = e.pageX - bounds.left - pointBounds.outerWidth / 2;
        this._setNewColor(left, top);     
    }

    /** @private */
    _setPoint(left = null, top = null) {
        const bounds = this._element.bounds();
        const pointBounds = this._pointer.container.bounds();
        let S = this._S * 100;
        let V = this._V * 100;

        left = left ? left : bounds.outerWidth * S / 100 - pointBounds.outerWidth / 2;
        top = top ? top : bounds.outerHeight - bounds.outerHeight * V / 100 - pointBounds.outerHeight / 2;
        this._pointer.styles = {left: (left) + 'px', top: (top) + 'px'};
    }

    /** @private */
    _showColor() {
        this.styles = {backgroundImage: 'linear-gradient(to right, #ffffff, ' + this._color + ')'};
    }

    /**
     * Color of block
     * @type {Colibri.UI.Rgb|string|{r,g,b,a}}
     */
    get color() {
        // do nothing
    }
    /**
     * Color of block
     * @type {Colibri.UI.Rgb|string|{r,g,b,a}}
     */
    set color(value) {
        if(value instanceof Colibri.UI.Rgb) {
            value = value.hex;
        }
        else if(Object.isObject(value)) {
            value = Colibri.UI.Rgb.Create().fromObject(value).hex;
        }
        else if(typeof value == 'number') {
            // hue
            value = Colibri.UI.Rgb.Create().fromHue(value).hex;
        }
        this._color = value;
        this._hue = Colibri.UI.Rgb.Create().fromHex(this._color).hue;
        this._showColor();
    }

    /**
     * Value
     * @type {string|number}
     */
    set value(value) {
        if(typeof value == 'string') {
            value = Colibri.UI.Rgb.Create().fromHex(value);
        }
        else if(typeof value == 'number') {
            value = Colibri.UI.Rgb.Create().fromHue(value);
        }
        
        this._S = value.hsv.s;
        this._V = value.hsv.v;
        this._hue = value.hsv.h;
        this.color = value.hsv.h;
        this._setPoint();
    }

    /**
     * Value
     * @type {Colibri.UI.Rgb}
     */
    get value() {
        return Colibri.UI.Rgb.Create().fromHSV(this._hue, this._S, this._V);
    }

}
/**
 * @class
 * @extends Colibri.UI.Component
 * @memberof Colibri.UI
 */
Colibri.UI.Color.Alpha = class extends Colibri.UI.Component {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     */
    constructor(name, container) {
        super(name, container, Element.create('div'));
        this.AddClass('app-color-alpha-component');

        this.RegisterEvent('Changed', false, 'Когда значение изменилось');

        this._pointer = new Colibri.UI.Pane(this.name + '_pointer', this);
        this._pointer.AddClass('app-color-alpha-pointer-component');
        this._pointer.shown = true;

        this.AddHandler('Clicked', (event, args) => this.__lineClicked(event, args));
        this.tabIndex = 0;
        this.AddHandler('KeyDown', (event, args) => this.__keyDown(event, args));

        new Colibri.UI.Drag(this._pointer.container, this.container, (left, top) => {
            this._pointer.styles = {top: top + 'px'};
            this._setNewValue(top);
        });
        
    }

    /** @private */
    _setNewValue(top) {
        const bounds = this._element.bounds();
        const trackbounds = this._pointer.container.bounds();

        top = top + trackbounds.outerHeight / 2;
        const percent = top * 100 / bounds.outerHeight;
        const alpha = percent * 255 / 100;
        
        this._value = Math.round(alpha);
        this.Dispatch('Changed');          
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __keyDown(event, args) {
        if(['ArrowUp', 'ArrowDown'].indexOf(args.domEvent.code) !== -1) {
            if(args.domEvent.code == 'ArrowUp') {
                this._value -= 1;
                this._setTrackPosition();
                this.Dispatch('Changed'); 
            }
            else if(args.domEvent.code == 'ArrowDown') {
                this._value += 1;
                this._setTrackPosition();
                this.Dispatch('Changed'); 
            }
        }
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __lineClicked(event, args) {
        const bounds = this._element.bounds();
        const trackbounds = this._pointer.container.bounds();
        const e = args.domEvent;
        let top = e.pageY - bounds.top - trackbounds.outerHeight / 2;
        this._pointer.styles = {top: top + 'px'};
        this._setNewValue(top);
    }

    /** @private */
    _setTrackPosition() {
        const bounds = this._element.bounds()
        const topPercent = this._value * 100 / 255;
        const top = topPercent * bounds.outerHeight / 100;
        this._pointer.styles = {top: top + 'px'};
    }
    
    /**
     * Alpha value
     * @type {number}
     */
    get value() {
        return this._value;
    }

    /**
     * Alpha value
     * @type {number}
     */
    set value(value) {
        this._value = value;
        this._setTrackPosition();
    }

}
/**
 * @class
 * @namespace
 * @extends Colibri.UI.Component
 * @memberof Colibri.UI
 */
Colibri.UI.Input = class extends Colibri.UI.Component {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     * @param {Element|string} element to create in
     */
    constructor(name, container, element) {
        super(name, container, Element.create('div', {class: 'app-ui-component'}));

        this.GenerateChildren(element, this._element);

        this._hasClearIcon = true;

        this.AddClass('app-input-component');

        this._fillTimeoutValue = 500;

        new Colibri.UI.Icon('icon', this);
        new Colibri.UI.Pane('loadingicon', this);

        this._input = Element.create('input', { type: 'text', placeholder: this.placeholder || '' });
        this._element.append(this._input);

        new Colibri.UI.Pane('clear', this);

        this.Children('icon').shown = true;
        this.Children('clear').html = Colibri.UI.ClearIcon;
        this.Children('loadingicon').html = Colibri.UI.LoadingIcon;
        this.Children('icon').value = Colibri.UI.SearchIcon;

        this._input.addEventListener('keyup', (e) => {

            if(['Tab', 'Escape', 'Enter', 'ArrowDown', 'ArrowUp', 'Space'].indexOf(e.code) !== -1) {
                return true;
            }

            if(!!this.maxlength && this.type != 'text') {
                if( (this.value + '').length > this.maxlength ) {
                    this.value = (this.value + '').substring(0, this.maxlength);
                    e.preventDefault();
                    e.stopPropagation();
                    return false;
                }
            }

            if(this.readonly) {
                this.Children('clear').shown = false;
            } else {
                this.Children('clear').shown = this._hasClearIcon && this._input.value.length > 0;
            } 

            this.Dispatch('KeyUp', { value: this.value, domEvent: e });

            if(this._fillTimeout) {
                clearTimeout(this._fillTimeout);
                this._fillTimeout = null;
            }

            this._fillTimeout = setTimeout(() => {
                this.Dispatch('Filled', { value: this.value });
            }, this._fillTimeoutValue);

        });

        this._input.addEventListener('change', (e) => {
            this.Dispatch('Changed', { value: this.value, domEvent: e });
        });

        this._input.addEventListener('keydown', (e) => {
            this.Dispatch('KeyDown', { value: this.value, domEvent: e });
        });

        this._input.addEventListener('focus', (e) => this.Dispatch('ReceiveFocus', { domEvent: e }));

        this._input.addEventListener('mousedown', (e) => {
            e.target.focus();
            //e.target.select();
            return false;
        });

        this.Children('clear').AddHandler('Clicked', (event, args) => {
            if(!this.enabled) {
                return;
            }
            this._input.value = '';
            this._input.focus();
            // this._input.select();
            this.Children('clear').shown = false;
            this.loading = false;
            this.Dispatch('Cleared', args);
        });

        this._input.addEventListener('blur', (e) => {
            this.Dispatch('LoosedFocus', { value: this.value, domEvent: e });
        });

        this.AddHandler('LoosedFocus', (event, args) => {
            if(this._popup) {
                this._popup.Hide();
                this._popup.Dispose();
                this._popup = null;
            }
        });
        this.AddHandler('ReceiveFocus', (event, args) => {
            this._showSuggestions();
        });

    }

    /** @protected */
    _registerEvents() {
        super._registerEvents();
        this.RegisterEvent('KeyUp', false, 'Поднимается, когда клавиша поднята');
        this.RegisterEvent('KeyDown', false, 'Поднимается, когда клавиша нажата');
        this.RegisterEvent('Changed', false, 'Поднимается, когда содержимое поля обновлено');
        this.RegisterEvent('Filled', false, 'Поднимается, когда содержимое поля обновлено и не изменилось в течении fillTimeout мс');
        this.RegisterEvent('Cleared', false, 'Поднимается, когда содержимое поля очищено с помощью крестика');
    }

    /**
     * Focus on component
     * @returns this
     */
    Focus() {
        this._input.focus();
        return this;
    }

    /**
     * Select content of input
     * @returns this
     */
    Select() {
        if(!this.readonly) {
            this._input.select();
        }
        return this;
    }

    /** 
     * Show/Hide loading
     * @type {boolean} 
     */
    get loading() {
        return this.Children('loadingicon').shown;
    }
    /** 
     * Show/Hide loading
     * @type {boolean} 
     */
    set loading(value) {
        value = this._convertProperty('Boolean', value);
        if(this.hasIcon) {
            this.Children('icon').shown = !value;
        }
        this.Children('loadingicon').shown = value;
    }
    /** @private */
    _hideLoading() {
        if(this.icon) {
            this.icon.shown = true;
        }
        this.loadingicon.shown = false;
    }

    /** 
     * Max length in chars of input
     * @type {number} 
     */
    get maxlength() {
        return this._input.attr('maxlength');
    }
    /** 
     * Max length in chars of input
     * @type {number} 
     */
    set maxlength(value) {
        value = this._convertProperty('Number', value);
        this._input.attr('maxlength', value);
    }

    /** 
     * Type of input
     * @type {string} 
     */
    get type() {
        return this._input.attr('type');
    }
    /** 
     * Type of input
     * @type {string} 
     */
    set type(value) {
        value = this._convertProperty('String', value);
        this._input.attr('type', value);
    }

    /** 
     * Input placeholder
     * @type {string} 
     */
    get placeholder() {
        try {
            return this._input.attr('placeholder');
        }
        catch(e) {
            return '';
        }
    }
    /** 
     * Input placeholder
     * @type {string} 
     */
    set placeholder(value) {
        value = this._convertProperty('String', value);
        this._input.attr('placeholder', value ? (value[Lang.Current] ?? value) : '');
    }

    /** 
     * Input icon
     * @type {string} 
     */
    get icon() {
        return this.Children('icon').html;
    }
    /** 
     * Input icon
     * @type {string} 
     */
    set icon(value) {
        value = this._convertProperty('String', value);
        if(value === null) {
            this.Children('icon').html = '';
            this.Children('icon').shown = false;
        }
        else {
            this.Children('icon').html = eval(value);
            this.Children('icon').shown = true;
        }
    }

    /** 
     * Input value
     * @type {string} 
     */
    get value() {
        return this._input.value;
    }
    /** 
     * Input value
     * @type {string} 
     */
    set value(value) { 
        value = this._convertProperty('String', value);
        this._input.value = value;
        if(this.Children('clear')) {
            this.Children('clear').shown = this._hasClearIcon && this._input.value.length > 0;
        }
    }

    /** 
     * Input is readonly
     * @type {boolean} 
     */
    get readonly() {
        return this._input.is(':scope[readonly]');
    }
    /** 
     * Input is readonly
     * @type {boolean} 
     */
    set readonly(value) {
        value = this._convertProperty('Boolean', value);
        if(value === true || value === 'true') {
            this._input.attr('readonly', 'readonly').attr('tabindex', '-1');
        }
        else {
            this._input.attr('readonly', null).attr('tabindex', null);
        }
        this.Dispatch('ReadonlyStateChanged');
    }

    /** 
     * Input has icon
     * @type {boolean} 
     */
    set hasIcon(value) {
        value = this._convertProperty('Boolean', value);
        this.Children('icon').shown = value;
    }
    /** 
     * Input has icon
     * @type {boolean} 
     */
    get hasIcon() {
        return this.Children('icon').shown;
    }

    /** 
     * Input has clear icon
     * @type {boolean} 
     */
    set hasClearIcon(value) {
        value = this._convertProperty('Boolean', value);
        this._hasClearIcon = value;
        this.Children('clear').shown = value;
    }
    /** 
     * Input has clear icon
     * @type {boolean} 
     */
    get hasClearIcon() {
        return this._hasClearIcon;
    }

    /** 
     * Enable/disable input
     * @type {Boolean} 
     */
    get enabled() {
        return super.enabled;
    }
    /** 
     * Enable/disable input
     * @type {Boolean} 
     */
    set enabled(val) {
        val = this._convertProperty('Boolean', val);
        super.enabled = val;
        this._input.attr('disabled', val === true || val === 'true' ? null : 'disabled');
    }

    /**
     * Tab index
     * @type {number}
     */
    get tabIndex() {
        return this._input.attr('tabIndex');
    }
    /**
     * Tab index
     * @type {number}
     */
    set tabIndex(value) {
        value = this._convertProperty('Number', value);
        this._input.attr('tabIndex', value === true ? Colibri.UI.tabIndex++ : value);
    }

    /**
     * Mask string 
     * @type {string}
     */
    get mask() {
        if(this._masker) {
            return this._masker.opts.pattern;
        }
        return null;
    }
    /**
     * Mask string 
     * @type {string}
     */
    set mask(value) {
        value = this._convertProperty('String', value);
        this._masker = new Colibri.UI.Utilities.Mask([this._input]);
        this._masker.maskPattern(value);
    }

    /**
     * Suggestions array
     * @type {Array}
     */
    get suggestions() {
        return this._suggestions;
    }
    /**
     * Suggestions array
     * @type {Array}
     */
    set suggestions(value) {
        value = this._convertProperty('Array', value);
        this._suggestions = value;
    }
    /** @private */
    _createPopup(values) {
        const popup = new Colibri.UI.PopupList('select-popup', document.body, this._multiple, this.__render, this._titleField, this._valueField, this._groupField);
        popup.parent = this;
        popup.multiple = this._multiple;
        const el = this.container.closest('[namespace]');
        el && popup.container.attr('namespace', el.attr('namespace'));
        //заполнение списка перед хэндлерами, чтобы не сработал SelectionChanged
        popup.FillItems(values, this._value);
        popup.AddHandler('MouseDown', (event, args) => {
            this._input.value = popup?.selected?.value;
        });
        return popup;
    }
    /** @private */
    _showSuggestions() {
        if(this._suggestions && this._suggestions.length > 0) {
            if(!this._popup) {
                this._popup = this._createPopup(this._suggestions);
            }
            this._popup.Show();    
        }
    }

    /**
     * Fill timeout, default is 500
     * @type {Number}
     */
    get fillTimeout() {
        return this._fillTimeoutValue;
    }
    /**
     * Fill timeout, default is 500
     * @type {Number}
     */
    set fillTimeout(value) {
        value = this._convertProperty('Number', value);
        this._fillTimeoutValue = value;
    }

    /**
     * Is value of input exceeded input width
     * @type {Boolean}
     */
    get isValueExceeded() {
        return this._input.isValueExceeded();
    }

}
