/**
 * @class
 * @extends Colibri.UI.List
 * @memberof Colibri.UI
 */
Colibri.UI.PopupList = class extends Colibri.UI.List {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     * @param {boolean} multiple is selection must be multiple
     * @param {string} titleField title field for show
     * @param {string} valueField value field to return in value property
     * @param {string|null} groupField field to group in list
     * @param {boolean} can select group
     */
    constructor(name, container, multiple, __render, titleField = 'title', valueField = 'value', groupField = null, canSelectGroup = false) {
        super(name, container, null, multiple);
        this.AddClass('app-component-popup-list-component');


        this.__renderElement = __render;
        this._titleField = titleField;
        this._valueField = valueField;
        this._groupField = groupField;
        this._canSelectGroup = canSelectGroup;
        this.tabIndex = null;
        this.AddHandler('ShadowClicked', (event, args) => {
            this.Hide();
        });

        this.handleVisibilityChange = true;
        this.AddHandler('VisibilityChanged', (event, args) => {
            const bounds = this.parent.container.bounds(true, true);
            if(!args.state) {
                this.top = null;
                this.bottom = (window.innerHeight - bounds.top);
            }
        });

        this.AddHandler('KeyDown', (event, args) => {
            return false;
        });

    }

    /** @private */
    __popupBounds() {
        return this.parent.container.bounds();
    }

    /**
     * Show/Hide component
     * @type {boolean}
     */
    set shown(value) {
        super.shown = value;
        this.container.hideShowProcess(() => {
            if(this.parent) {
                const bounds = this.__popupBounds();
                this.top = bounds.top + bounds.outerHeight;
                this.left = bounds.left;
                this.width = bounds.outerWidth;    
                if(value) {
                    this.AddClass(this.parent.name + '-selector-popup');
                    this.BringToFront();
                } else {
                    this.RemoveClass(this.parent.name + '-selector-popup');
                    this.SendToBack();
                }    
            }
            this.hasShadow = value;
            this.Dispatch('VisibilityChanged', {state: true});
            if(this._selected.length && this._selected[0] instanceof Colibri.UI.List.Item) {
                this._selected[0].EnsureVisible(this);
            }
        });
    }

    /**
     * Show/Hide component
     * @type {boolean}
     */
    get shown() {
        return super.shown;
    }

    /** @protected */
    __renderItemContent(itemData, item) {
        let html = '';

        try {
            if(this.__renderElement !== null) {
                html = this.__renderElement(itemData, item);
            } else if(itemData[this._titleField ?? 'title'] !== null) {
                html = Lang ? Lang.Translate(itemData[this._titleField ?? 'title']) : itemData[this._titleField ?? 'title'];
            } else {
                html = itemData;
            }
        
            if(this._multiple) {
                html = '<div class="app-popup-list-item-content"><div>' + html + '</div>' + Colibri.UI.SelectCheckIcon + '</div>';
            }
        }
        catch(e) {
            console.log(e);
        }
        
        return html;
    }

    /**
     * Fill the items
     * @param {Array} value items
     * @param {Array} selectedValues Selected items
     */
    FillItems(value, selectedValues = null) {

        this.ClearAllGroups();
        this.ClearSelection(false);

        if(!Array.isArray(value)) {
            return;
        }

        const values = Object.values(value);
        if(this._groupField) {

            

            const selectedKeys = [];
    
            if(selectedValues !== undefined && selectedValues !== null && selectedValues !== '') {
                if(!Array.isArray(selectedValues)) {
                    selectedValues = [selectedValues];
                }
                selectedValues.forEach((val) => {
                    selectedKeys.push(String(val[this._valueField] ?? val));
                });
            }

            if(this._canSelectGroup) {
                const group = this.AddGroup('group', '');
                for(let val of values) {
                    if(val[this._groupField] === true) {
                        const item = group.AddItem(val, null);
                        item.AddClass('-group');
                    }
                    group.AddItem(val, null);
                }
            }
            else {
                const groups = {};
                for(let val of values) {
                    if(!groups[String.MD5(val[this._groupField])]) {
                        groups[String.MD5(val[this._groupField])] = this.AddGroup(String.MD5(val[this._groupField]), val[this._groupField]);
                    }
                    if(selectedKeys.includes(String(val[this._valueField] ?? val))) {
                        groups[String.MD5(val[this._groupField])].AddItem(val, null, true);
                    }
                    else {
                        groups[String.MD5(val[this._groupField])].AddItem(val, null);
                    }
                    
                }
            }
    
            

        }
        else {

            const group = this.AddGroup('group', '');
            const selectedKeys = [];
    
            if(selectedValues !== undefined && selectedValues !== null && selectedValues !== '') {
                if(!Array.isArray(selectedValues)) {
                    selectedValues = [selectedValues];
                }
                selectedValues.forEach((val) => {
                    selectedKeys.push(String(val[this._valueField] ?? val));
                });
            }

            for(let val of values) {
                if(selectedKeys.includes(String(val[this._valueField] ?? val))) {
                    group.AddItem(val, null, true);
                }
                else { 
                    group.AddItem(val, null);
                }
            }
                
        }

    }

}

/**
 * @class
 * @extends Colibri.UI.Component
 * @memberof Colibri.UI
 */
Colibri.UI.Selector = class extends Colibri.UI.Component {

    /** @type {boolean} */
    _skipLooseFocus;
    /** @type {boolean} */
    _itemSelected;

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|string|Colibri.UI.Component} container component container 
     * @param {boolean} multiple is multiple selection
     * @param {boolean} readonly only for read
     * @param {boolean} searchable can search in items 
     * @param {string[]|null} values values to show in select box 
     * @param {string|number|null} defaultValue default value for selection 
     * @param {string} titleField name of title field
     * @param {string} valueField name of value field 
     * @param {Function|null} __render method for render items
     * @param {boolean} allowEmpty is allowed empty values
     * @param {boolean} clearIcon show clear icon
     */
    constructor(name, container, multiple = false, readonly = true, searchable = true, values = [], defaultValue = null, titleField = 'title', valueField = 'value', groupField = null, __render = null, allowEmpty = true, clearIcon = false, canSelectGroup = false) {
        super(name, container, Element.create('div'));

        this.AddClass('app-selector-component');

        this._multiple = multiple;
        this.__render = __render;
        this._titleField = titleField || 'title';
        this._valueField = valueField || 'value';
        this._groupField = groupField || null;
        this._default = defaultValue;
        this._values = values;
        this._inprooveValues();
        this._value = [];
        this._placeholder = '';

        this._input =  new Colibri.UI.Input(this._name + '-input', this);
        this._input.shown = true;
        this._input.icon = null;
        this._input.hasIcon = false;
        this._input.hasClearIcon = clearIcon;
        this._input.placeholder = this._placeholder;
        this._input.toolTip = '';

        this._arrow = Element.create('span', {class: 'arrow'});
        this._arrow.html(Colibri.UI.SelectArrowIcon);
        this._element.append(this._arrow);

        this.readonly = readonly;
        this.searchable = searchable;
        this.allowempty = allowEmpty;
        this.canSelectGroup = canSelectGroup;

        this._setValue(this._default);
        this._renderValue();

        this._handleEvents();
    }

    /** @private */
    _inprooveValues() {
        let v = [];
        for(let vv of this._values) {
            if(!Object.isObject(vv)) {
                vv = {value: vv, title: vv};
            }
            v.push(vv);
        }
        this._values = v;
    }


    /** @protected */
    _registerEvents() {
        super._registerEvents();

        this.RegisterEvent('Changed', false, 'Когда выбор изменился');
    }

    /** @private */
    __preventScrolling(e) {
        e.preventDefault();
    }
    
    /** @private */
    _changeBodyScroll() {

        let wnd = this._element.closest('.app-component-window');
        wnd = wnd ?? document.body;
        const scrolling = new Colibri.Common.Scrolling(wnd);
        if (this._popup && this._popup.shown) {
            scrolling.Disable();
        } else {
            scrolling.Enable();
        }
    }

    /** @protected */
    _handleEvents() {

        this._input.AddHandler('KeyUp', (event, args) => this.Dispatch('KeyUp', args));

        this._input.AddHandler('Filled', (event, args) => this.__Filled(event, Object.assign(args, {search: true})));
        this._input.AddHandler('Cleared', (event, args) => this.__Cleared(event, args));
        this._input.AddHandler('Clicked', (event, args) => this.__Clicked(event, args));
        this._input.AddHandler('ReceiveFocus', (event, args) => this.Dispatch('ReceiveFocus', args));
        this._input.AddHandler('LoosedFocus', (event, args) => !this._skipLooseFocus && this.Dispatch('LoosedFocus', args));


        this._arrow.addEventListener('click', (e) => { 
            this.Focus();
            if(this.enabled) {
                this.__Filled(null, {search: false});
            }
            return false; 
        });

        this._input.AddHandler('LoosedFocus', (event, args) => {
            if(!this._skipLooseFocus) {
                this._hidePopup();
            }
        });
        this.AddHandler('LoosedFocus', (event, args) => {
            if(!this._skipLooseFocus) {
                this._hidePopup();
            }
        });

        // перехватить keydown и обработать Escape
        this._input.AddHandler('KeyDown', (event, args) => {

            // , 'Space'
            if(['Escape', 'ArrowUp', 'ArrowDown', 'Enter', 'NumpadEnter'].indexOf(args.domEvent.code) !== -1) {

                if(args.domEvent.code === 'Escape') {
                    this._hidePopup();
                }
                else if(args.domEvent.code === 'Space') {
                    if(this.enabled) {
                        this.__Filled(null, {search: false});
                    }
                }
                else if(args.domEvent.code === 'ArrowUp') {
                    if(!this._popup) {
                        this.Focus();
                    }
                    try { this.__moveSelection(-1); } catch(e) {}
                }
                else if(args.domEvent.code === 'ArrowDown') {
                    if(!this._popup) {
                        this.Focus();
                    }
                    try { this.__moveSelection(1); } catch(e) {}
                    
                }
                else if(args.domEvent.code === 'Enter') {
                    this._popup.Dispatch('Clicked', {domEvent: args.domEvent});
                }
    
                args.domEvent.stopPropagation();
                args.domEvent.preventDefault();
                return false;
            }


            return this.Dispatch('KeyDown', args);        
        });

    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __Filled(event, args) {
        this._itemSelected = false;
        this.__BeforeFilled().then((searchAllreadyPerformed = false) => {
            if(this._itemSelected === true) {
                return;
            }
            
            const values = this._search(!this.searchable || !args.search || searchAllreadyPerformed ? '' : this._input.value);
            this._showPopup(values);
            
            // if(this.allowempty) {
            //     this.Dispatch('Changed', args);
            // }

            this._renderValue(false);
        });

        args?.domEvent?.preventDefault();
        args?.domEvent?.stopPropagation();

        return false;
    }

    /** @public */
    async __BeforeFilled() {
        return true;
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __Cleared(event, args) {
        const values = this._search(!this.searchable ? '' : this._input.value);
        this._setValue(null);

        if (this._popup) {
            this._popup.FillItems(values);
        }

        this._lastValue = null;

        this.Dispatch('Changed', args);
        this._renderValue(false);

        args.domEvent?.preventDefault();
        args.domEvent?.stopPropagation();
        return false;
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __Clicked(event, args) { 
        this.Focus();
        if(this.enabled) {
            this.__Filled(null, {search: false});
        }    
        args.domEvent.stopPropagation();
        args.domEvent.preventDefault();
        return false;
    }

    /** @private */
    _removePopup() {
        if(this._popup) {
            this._popup.shown = false;
            this._popup.Dispose();
            this._popup = null;
            if(!this.allowempty && (!this._value || !this._value.length) && this._lastValue) {
                this.value = this._lastValue;
            }
            this.SendToBack();
        }
    }

    /** @private */
    _hidePopup() {
        this._removePopup();
        this._input.SendToBack();
        this._changeBodyScroll();
    }

    /**
     * Show dropdown
     * @private
     * @param {Array} values values to show
     */
    _showPopup(values) {

        if(this.readonly || !this.enabled) {
            return;
        }

        if(!this._popup) {
            this._popup = this._createPopup(values);
            this._registerPopupEventHandlers(this._popup);
        }
        else {
            this._popup.FillItems(values, this._lastValue);
        }

        if(!this._popup.shown) {
            this._popup.Show();
            if(this._popupconfig) {
                Object.assign(this._popup, this._popupconfig);
            }
            this._input.BringToFront();
        }

        this._changeBodyScroll();

    }

    /** @private */
    __moveSelection(positionDelta) {
        if(!this._popup?.selected) {
            this._popup.selectedIndex = 0;
            return;
        }

        this._popup.selectedIndex = this._popup.selectedIndex + positionDelta;

    }

    /**
     * Selected value
     * @return {Array|Object|boolean}
     */
    get value() {
        if (!this._multiple) {
            return this._value[0] ?? null;
        }
        return this._value;
    }

    /**
     * Selected value
     * @return {Array|Object|boolean}
     */
    set value(value) {
        this._setValue(value);
        this._renderValue();
    }

    /**
     * Is multiple
     * @type {boolean}
     */
    set multiple(value) {
        this._multiple = value === 'true' || value === true;
    }
    /**
     * Is multiple
     * @type {boolean}
     */
    get multiple() {
        return this._multiple;
    }


    /** @private */
    _setValue(value) {
        if (value === null || value === false) {
            this._value = [];
            if(this.allowempty) {
                this._lastValue = this._value;
            }
        }
        else if(Array.isArray(value)) {
            if (!this._multiple) {
                this._value = [];
                this._value.push(this._lastValue = value.shift());
            } else {
                value = value.map(v => Object.isObject(v) ? v : this._findValue(v));
                this._lastValue = this._value = value;
            }
        }
        else if(Object.isObject(value)) {
            if (!this._multiple) {
                this._value = [];
            }
            this._lastValue = value;
            this._value.push(value);
        }
        else {
            if (!this._multiple) {
                this._value = [];
                let _found = this._findValue(value);
                if(_found) {
                    this._value.push(_found);
                    this._lastValue = _found;
                }
            
            }
            else {
                this._value = [];
                value = !Array.isArray(value) ? value.split(',') : value;
                for(const v of value) {
                    let _found = this._findValue(v);
                    if(_found) {
                        this._value.push(_found);
                        this._lastValue = _found;
                    }        
                }
            }
        }
    }

    /**
     * Search for value
     * @param {string|number} value value
     * @returns string
     */
    _findValue(value) {
        let foundValue = null;
        if(value) {
            value = value[this._valueField] ?? value;
        }
        if(this._values) {
            const values = Object.values(this._values);
            for(let vv of values) {
                if(!Object.isObject(vv)) {
                    vv = {value: vv, title: vv}
                }
                if (vv[this._valueField] == value) {
                    foundValue = vv;
                    break;
                }
            }
        }
        return foundValue;
    }

    /**
     * Render values
     * @private
     */
    _renderValue(renderValue = true) {
        if (!this.multiple) {
            if(renderValue) {
                let v = '';
                if(Array.isArray(this._value)) {
                    v = (this._value[0] !== '' && this._value[0] !== null && this._value[0] !== undefined ? (this._value[0][this._titleField] ?? this._value[0] ?? '') : '');
                    if(Object.isObject(v)) {
                        try { v = v[Lang.Current] } catch(e) { v = ''; };
                    }
                    else {
                        v = (v + '').stripHtml();
                    }
                }
                else {
                    if(Object.isObject(this._value)) {
                        try { v = this._value[Lang.Current] } catch(e) { v = ''; };
                    }
                    else {
                        v = (this._value + '').stripHtml();
                    }
                }
                this._input.value = v;
            }

            if(!this._placeholderempty || this.HaveValues()) {
                this._input.placeholder = (this.placeholder ?? '').stripHtml();
            } else {
                this._input.placeholder = this._placeholderempty.stripHtml();
            }
        } else {
            let itemCount = this._value.length;
            this._input._forcedClearIcon = (itemCount !== 0);
            renderValue && (this._input.value = '');

            if(itemCount === 0) {
                this._input.placeholder = this.placeholder ?? '';
            } else if(this._placeholderinfo) {
                let info = this._placeholderinfo;
                if(this._placeholderinfo instanceof Function) {
                    info = this._placeholderinfo;
                    info(this._value, this._values).then((text) => {
                        this._input.placeholder = (text + '').stripHtml();
                    });
                } else {
                    try {
                        info = eval(this._placeholderinfo);
                        info(this._value, this._values).then((text) => {
                            this._input.placeholder = (text + '').stripHtml();
                        });
                    } catch(e) {
                        this._input.placeholder = String.Pluralize(this._placeholderinfo, itemCount).stripHtml();
                    }    
                }
            } else {
                this._input.placeholder = ''.replaceAll('%s1', itemCount).replaceAll('%s2', this?.parent?.parent?.title).stripHtml();
            }
        }
        if(this._showToolTip) {
            this._input.toolTip = this._input.isValueExceeded ? (this._input.value ?? this._input.placeholder) : '';
        }
    }

    /**
     * Set focus on selector
     */
    Focus() {
        if(this._input?.readonly) {
            this._element.focus();
            this.Dispatch('ReceiveFocus', {});
        } else {
            this._input.Focus();
        }
    }

    /**
     * Is selector has values
     * @returns {boolean}
     */
    HaveValues() {
        const values = this.values;
        return !!(values && Object.values(values).length);
    }

    /**
     * Readonly
     * @type {boolean}
     */
    get readonly() {
        return this._readonly;
    }
    /**
     * Readonly
     * @type {boolean}
     */
    set readonly(value) {
        this._readonly = value === true || value === 'true';
        if(!this._searchable) {
            this._input.readonly = true;
        } else if(this._readonly) {
            this._input.readonly = true;
        }
        else {
            this._input.readonly = false;
        }
        if(this._readonly) {
            this.AddClass('app-component-readonly');
        } else {
            this.RemoveClass('app-component-readonly');
        }
    }

    /**
     * Can search in items
     * @type {boolean}
     */
    get searchable() {
        return this._searchable;
    }
    /**
     * Can search in items
     * @type {boolean}
     */
    set searchable(value) {
        this._searchable = value === true || value === 'true';
        if(this._searchable) {
            this.AddClass('app-component-searchable');
            this._input.readonly = false;
        }
        else {
            this.RemoveClass('app-component-searchable');
            this.tabIndex = -1;
            this._input.readonly = true;
        }
    }

    /**
     * Selector placeholder 
     * @type {string}
     */
    get placeholder() {
        return this._placeholder;
    }
    /**
     * Selector placeholder
     * @type {string}
     */
    set placeholder(value) {
        this._placeholder = value ? value[Lang.Current] ?? value : '';
        this._input.placeholder = this._placeholder;
        this._renderValue(false);
    }

    /**
     * Selector placeholder 
     * @type {Object}
     */
    get placeholderinfo() {
        return this._placeholderinfo;
    }
    /**
     * Selector placeholder 
     * @type {Object}
     */
    set placeholderinfo(value) {
        this._placeholderinfo = value;
        this._renderValue(false);
    }

    /**
     * Empty placeholder generate method
     * @type {Function}
     */
    get placeholderempty() {
        return this._placeholderempty;
    }
    /**
     * Empty placeholder generate method
     * @type {Function}
     */
    set placeholderempty(value) {
        this._placeholderempty = value;
    }

    /**
     * Enable/Disable
     * @type {boolean}
     */
    get enabled() {
        return this._input.enabled;
    }
    /**
     * Enable/Disable
     * @type {boolean}
     */
    set enabled(value) {
        if(value) {
            this.RemoveClass('app-component-disabled');
        }
        else {
            this.AddClass('app-component-disabled');
        }
        this._input.enabled = value;
    }

    /**
     * Array of values to show
     * @type {Array}
     */
    get values() {
        return this._values;
    }
    /**
     * Array of values to show
     * @type {Array}
     */
    set values(value) {
        this._values = value;
        this._renderValue(false);
    }

    /**
     * Search for items to show in selector
     * @param {string} searchString search string
     * @return {Array}
     *  */
    _search(searchString) {
        if (!searchString) {
            return this._values ?? {};
        }

        let searchPattern = new RegExp('.*?' + String.EscapeRegExp(searchString.stripHtml()).replaceAll(/\s+/, '.+') + '.*?', 'i');
        let values = this._values;
        let matches = [];
        let startMatches = [];

        Array.isArray(values) && values.forEach((value) => {
            let stringPosition = value[this._titleField] ? value[this._titleField].search(searchPattern) : 0;
            if (stringPosition !== -1) {
                stringPosition === 0 ? startMatches.push(value) : matches.push(value);
            }
        });

        // элементы, которые начинаются со строки поиска, переносятся в начало списка
        return startMatches.concat(matches);
    }

    /**
     * Config of popup
     * @type {*}
     */
    get popupconfig() {
        return this._popupconfig;
    }
    /**
     * Config of popup
     * @type {*}
     */
    set popupconfig(value) {
        this._popupconfig = value;
    }

    /**
     * Tab index
     * @type {number}
     */
    get tabIndex() {
        return this._input && this._input.tabIndex;
    }
    /**
     * Tab index
     * @type {number}
     */
    set tabIndex(value) {
        if (this._input) {
            this._input.tabIndex = value;
        }
    }

    /** @private */
    _createPopup(values) {
        const popup = new Colibri.UI.PopupList(this.name + '-select-popup', document.body, this._multiple, this.__render, this._titleField, this._valueField, this._groupField, this._canSelectGroup);
        popup.parent = this;
        popup.multiple = this._multiple;
        const el = this.container.closest('[namespace]');
        el && popup.container.attr('namespace', el.attr('namespace'));

        //заполнение списка перед хэндлерами, чтобы не сработал SelectionChanged
        popup.FillItems(values, this._value);

        return popup;
    }

    /** @private */
    _registerPopupEventHandlers(popup) {
        // сначала происходит SelectionChanged потом ItemClicked, странность, но так сделано
        // SelectionChanged появляется внутри списка, и не связан с значением по умолчанию в селекторе
        popup.AddHandler('ItemMouseDown', (event, args) => {
            this._skipLooseFocus = true;
        });
        popup.AddHandler('Clicked', (event, args) => {
            this._skipLooseFocus = false;
            this._itemSelected = true;
            args?.domEvent.stopPropagation();
            args?.domEvent.preventDefault();

            let selected;
            if (!this._multiple) {
                selected = popup.selected?.value ?? [];
                popup.Dispatch('ShadowClicked');
            } else {
                selected = popup.selected?.map((item) => { return item.value; }) ?? [];
            }

            if(!Array.isArray(selected)) {
                selected = [selected];
            }

            if(JSON.stringify(selected) === JSON.stringify(this._value)) {
                return false;
            }

            this._setValue(selected);
            this._renderValue(!this._multiple);
            this.Focus();
            this.Dispatch('Changed', args);
            
            return false;
        });
        

        popup.AddHandler('ShadowClicked', () => {
            this._hidePopup();
            this.Focus();
        });
    }

    /**
     * Groups can be selected
     * @type {boolean}
     */
    get canSelectGroup() {
        return this._canSelectGroup;
    }
    /**
     * Groups can be selected
     * @type {boolean}
     */
    set canSelectGroup(value) {
        this._canSelectGroup = value;
    }

    /**
     * Shows the component
     * @type {boolean}
     */
    get shown() {
        return super.shown;
    }
    /**
     * Shows the component
     * @type {boolean}
     */
    set shown(value) {
        super.shown = value;
        this._removePopup();
    }

    /**
     * Title field name 
     * @type {string}
     */
    get titleField() {
        return this._titleField;
    }
    /**
     * Title field name 
     * @type {string}
     */
    set titleField(value) {
        this._titleField = value;
    }

    /**
     * Value field name
     * @type {string}
     */
    get valueField() {
        return this._valueField;
    }
    /**
     * Value field name
     * @type {string}
     */
    set valueField(value) {
        this._valueField = value;
    }

    /**
     * Tooltip string
     * @type {string}
     */
    get showToolTip() {
        return this._showToolTip;
    }
    /**
     * Tooltip string
     * @type {string}
     */
    set showToolTip(value) {
        this._showToolTip = value === true || value === 'true';
        this._renderValue();
    }

}


/**
 * @class
 * @extends Colibri.UI.Component
 * @memberof Colibri.UI
 */
Colibri.UI.DateSelector = class extends Colibri.UI.Component {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     */    
    constructor(name, container) {
        super(name, container, Element.create('div'));

        this.AddClass('app-date-selector-component');

        this._hiddenElement = Element.create('input', {type: 'date', class: 'ui-hidden', name: name});
        this._viewElement = Element.create('input', {type: 'text', name: name + '_view'});

        this._icon = new Colibri.UI.Icon('icon', this);
        this._icon.value = Colibri.UI.CalendarIcon;
        this._icon.shown = true;

        this._element.append(this._hiddenElement);
        this._element.append(this._viewElement);

        this._hiddenElement.addEventListener('click', (e) => {this.Dispatch('Clicked', { domEvent: e }); e.preventDefault(); e.stopPropagation(); return false;});
        this._hiddenElement.addEventListener('change', (e) => {
            this._showValue();
            this.Dispatch('Changed');
            e.preventDefault();
        });
        this._hiddenElement.addEventListener('blur', (e) => {
            if(!this._skipLooseFocus) {
                this._showValue();
                this.Dispatch('Changed');
                this.Close();
            }
        });
        // this._hiddenElement.addEventListener('keydown', (e) => {
        //     e.stopPropagation(); 
        // });

        this._viewElement.addEventListener('click', (e) => this.Dispatch('Clicked', { domEvent: e }));
        this._viewElement.addEventListener('dblclick', (e) => this.Dispatch('DoubleClicked', { domEvent: e }));
        this._viewElement.addEventListener('mousedown', (e) => this.Dispatch('MouseDown', { domEvent: e }));
        this._viewElement.addEventListener('mouseup', (e) => this.Dispatch('MouseUp', { domEvent: e }));
        this._viewElement.addEventListener('mousemove', (e) => this.Dispatch('MouseMove', { domEvent: e }));
        this._viewElement.addEventListener('keydown', (e) => this.Dispatch('KeyDown', { domEvent: e }));
        this._viewElement.addEventListener('keyup', (e) => this.Dispatch('KeyUp', { domEvent: e }));
        this._viewElement.addEventListener('keypress', (e) => this.Dispatch('KeyPressed', { domEvent: e }));
        this._viewElement.addEventListener('focus', (e) => this.Dispatch('ReceiveFocus', { domEvent: e }));
        this._viewElement.addEventListener('blur', (e) => this.Dispatch('LoosedFocus', { domEvent: e }));
        this._hiddenElement.addEventListener('focus', (e) => this.Dispatch('ReceiveFocus', { domEvent: e }));
        this._hiddenElement.addEventListener('blur', (e) => this.Dispatch('LoosedFocus', { domEvent: e }));

        let dateformat = App.DateFormat || 'ru-RU';
        this._format = new Intl.DateTimeFormat(dateformat, {day: '2-digit', month: 'short', year: 'numeric'});

        this.AddHandler('Clicked', (event, args) => {
            if(this.enabled) {
                this.Open();
            }
            args.domEvent.stopPropagation();
            args.domEvent.preventDefault();
            return false;
        });

        this.AddHandler('KeyDown', (event, args) => {
            if(['Escape', 'Enter', 'Space'].indexOf(args.domEvent.code) !== -1) {
                if(this.enabled) {                    
                    if(args.domEvent.code === 'Space') {
                        this.Open();
                    }
                    else if(args.domEvent.code === 'Escape') {
                        this.Close();
                    }
                    else if(args.domEvent.code === 'Enter') {
                        this.Close();
                    }
                }

                args.domEvent.stopPropagation();
                args.domEvent.preventDefault();
                return false;
            }
        });


    }

    /** @protected */
    _registerEvents() {
        super._registerEvents();
        this.RegisterEvent('Changed', false, 'Когда значение изменилось');
        this.RegisterEvent('PopupOpened', false, 'Попап открыт');
        this.RegisterEvent('PopupClosed', false, 'Попап закрыт');
    }

    /** @private */
    _showValue() {

        try {
            this._viewElement.value = this._format.format(this.value);
        }
        catch(e) {
            this._viewElement.value = '';
        }    

        if(this._popup) {
            try {
                this._popup.value = this.value;
            }
            catch(e) {
                this._popup.value = new Date();
            }    
        }
    }

    /**
     * Open selector
     */
    Open() {
        if(!this._popup) {
            this._popup = new Colibri.UI.DateSelectorPopup('popup', document.body);
            this._popup.parent = this;
            const el = this.container.closest('[namespace]');
            el && this._popup.container.attr('namespace', el.attr('namespace'));
        }
        this._popup.mode = 'datepicker';
        this._popup.shown = true;
        this._popup.value = this.value;
        this._showValue();
        this.ToggleView(true);
        this._hiddenElement.focus();
        this.Dispatch('PopupOpened', {});

    }

    /**
     * Close selector
     */
    Close() {
        
        this.ToggleView(false);
        if(this._popup) {
            this._popup.Dispose();
            this._popup = null;
        }
        this._viewElement.focus();

        this.Dispatch('PopupClosed', {});
    }

    /**
     * Focus on component
     */
    Focus() {
        if(!this.enabled) {
            return;
        }
        this.ToggleView(true);
        this._hiddenElement.focus();
    }

    /**
     * Toggle view of input
     * @param {boolean} view toggle view of input
     */
    ToggleView(view) {

        if(!view) {
            this._viewElement.classList.remove('ui-hidden');
            this._hiddenElement.classList.add('ui-hidden');
            this._hiddenElement.css('position', null);
            this._hiddenElement.css('z-index', null);
            this.value && this.value != 'Invalid Date' && (this._viewElement.value = this._format.format(this.value));
        }
        else {
            this._viewElement.classList.add('ui-hidden');
            this._hiddenElement.classList.remove('ui-hidden');
            this._hiddenElement.css('position', 'relative');
            this._hiddenElement.css('z-index', Colibri.UI.maxZIndex + 1);
        }

    }

    /**
     * Placeholder
     * @type {string}
     */
    set placeholder(value) {
        this._viewElement.attr('placeholder', value ? value[Lang.Current] ?? value : '');
    }

    /**
     * Placeholder
     * @type {string}
     */
    get placeholder() {
        return this._viewElement.attr('placeholder');
    }

    /**
     * Enable/Disable
     * @type {boolean}
     */
    set enabled(value) {
        this._viewElement.attr('disabled', value ? null: 'disabled');
    }

    /**
     * Enable/Disable
     * @type {boolean}
     */
    get enabled() {
        return this._viewElement.attr('disabled') !== 'disabled';
    }

    /**
     * Is component readonly
     * @type {boolean}
     */
    set readonly(value) {
        this._viewElement.attr('readonly', value ? 'readonly' : null);
    }

    /**
     * Is component readonly
     * @type {boolean}
     */
    get readonly() {
        return this._viewElement.attr('readonly') !== 'readonly';
    }

    /**
     * Date value
     * @type {Date|string}
     */
    set value(value) {
        const oldValue = this._hiddenElement.value;
        if(!value) {
            this._hiddenElement.value = '';
        } else if(typeof value == 'string') {
            this._hiddenElement.value = value;
        } else if(value instanceof Date) {
            this._hiddenElement.value = value.toShortDateString();
        } else {
            this._hiddenElement.value = value && value?.date ? value?.date?.toDate()?.toShortDateString() : '';
        }
        this._showValue();
        if(oldValue != this._hiddenElement.value) {
            this.Dispatch('Changed');
        }
    }

    /**
     * Date value
     * @type {Date|string}
     */
    get value() {
        if(typeof this._hiddenElement.value == 'string') {
            return new Date(this._hiddenElement.value);
        }
        else if(this._hiddenElement.value instanceof Date) {
            return this._hiddenElement.value;
        }
        else {
            return null;
        }
    }

    /**
     * Format of date
     * @type {string}
     */
    get format() {
        return this._format;
    }

    /**
     * Format of date
     * @type {string}
     */
    set format(value) {
        this._format = value;
    }

    /**
     * Tab index
     * @type {number|boolean}
     */
    get tabIndex() {
        return this._viewElement.attr('tabIndex');
    }
    /**
     * Tab index
     * @type {number|boolean}
     */
    set tabIndex(value) {
        this._viewElement.attr('tabIndex', value === true ? Colibri.UI.tabIndex++ : value);
        this._hiddenElement.attr('tabIndex', value === true ? Colibri.UI.tabIndex++ : value);
    }

    /**
     * Has icon
     * @type {boolean}
     */
    get hasIcon() {
        return this._icon.shown;
    }
    /**
     * Has icon
     * @type {boolean}
     */
    set hasIcon(value) {
        this._icon.shown = value;
    }

}

/**
 * @class
 * @extends Colibri.UI.Pane
 * @memberof Colibri.UI
 */
Colibri.UI.DateSelectorPopup = class extends Colibri.UI.Pane {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     */        
    constructor(name, container) {
        super(name, container);

        this.AddClass('app-date-selector-popup-component');

        this.AddHandler('ShadowClicked', (event, args) => {
            this.parent.Close();
            args.domEvent.stopPropagation();
            args.domEvent.preventDefault();
        });

        this._pickerheader = this._element.append(Element.fromHtml('<div class="calendar__dropdown-pickerheader"></div>'));
        this._pickerheader.append(Element.fromHtml('<table><tr><td class="left">' + Colibri.UI.ArrowLeft + '</td><td class="calendar__dropdown-pickerheader_title"></td><td class="right">' + Colibri.UI.ArrowRight + '</td></tr></table>'));
        this._headerText = this._element.querySelector('.calendar__dropdown-pickerheader_title');

        this._datePicker = new Colibri.UI.DatePicker('date-picker', this);
        this._monthPicker = new Colibri.UI.MonthPicker('month-picker', this);
        this._yearPicker = new Colibri.UI.YearPicker('year-picker', this);

        this._mode = 'datepicker';
        this._value = new Date();
        this._datePicker.value = this._value;
        this._yearPicker.value = this._value;
        this._monthPicker.value = this._value;

        this.handleVisibilityChange = true;
        this.AddHandler('VisibilityChanged', (event, args) => {
            if(!this.parent) {
                return;
            }

            const bounds = this.parent.container.bounds();
            const b = this.container.bounds(true, true);
            if(!args.state) {
                this.top =  bounds.top - b.outerHeight;
                this.AddClass('-up');
            }

        });

        this._headerText.addEventListener('mousedown', (e) => {
            this.parent._skipLooseFocus = true;
        });
        this._headerText.addEventListener('click', (e) => {
            this.parent._skipLooseFocus = false;
            this.ToggleMode();
            e.stopPropagation();
            e.preventDefault();
            return false;
        });

        this._element.querySelector('.left').addEventListener('mousedown', (e) => {
            this.parent._skipLooseFocus = true;
        });
        this._element.querySelector('.left').addEventListener('click', (e) => {
            this.parent._skipLooseFocus = false;
            let dt = this.value.copy();

            if (this.mode == 'datepicker') {
                // передергиваем на месяц в назад
                dt.setMonth(dt.getMonth() - 1);
            } else if (this.mode == 'monthpicker') {
                // передергиваем на год назад
                dt.setFullYear(dt.getFullYear() - 1);
            } else if (this.mode == 'yearpicker') {
                // передергиваем на 10 лет назад
                dt.setFullYear(dt.getFullYear() - 10);
            }
            this.value = dt.copy();

            e.stopPropagation();
            e.preventDefault();
            return false;

        });

        this._element.querySelector('.right').addEventListener('mousedown', (e) => {
            this.parent._skipLooseFocus = true;
        });
        this._element.querySelector('.right').addEventListener('click', (e) => {
            this.parent._skipLooseFocus = false;
            let dt = this.value.copy();
            if (this.mode == 'datepicker') {
                // передергиваем на месяц вперед
                dt.setMonth(dt.getMonth() + 1);
            } else if (this.mode == 'monthpicker') {
                // передергиваем на год вперед
                dt.setFullYear(dt.getFullYear() + 1);
            } else if (this.mode == 'yearpicker') {
                // передергиваем на 10 лет вперед
                dt.setFullYear(dt.getFullYear() + 10);
            }

            this.value = dt.copy();

            e.stopPropagation();
            e.preventDefault();
            return false;

        });

        this._element.addEventListener('mousewheel', (e) => {

            if (e.deltaY < 0) {
                this._element.querySelector('.left').emitMouseEvent('click');
            } else if (e.deltaY > 0) {
                this._element.querySelector('.right').emitMouseEvent('click');
            }

            e.preventDefault();
            e.stopPropagation();
            return false;
        });

        this._show();

    }

    /**
     * Show/Hide
     * @type {boolean}
     */
    set shown(value) {
        super.shown = value;
        this.container.hideShowProcess(() => {
            const bounds = this.parent.container.bounds(true, true);
            this.top = bounds.top + bounds.outerHeight;
            this.left = bounds.left;
            this.RemoveClass('-up');        
            if(value) {
                this.BringToFront();
                this._show();
            }
            else {
                this.SendToBack();
            }
            this.hasShadow = value;
            if(this.ContainsClass('-up')) {
                this.Dispatch('VisibilityChanged', {state: false});
            }    
        });
    }
    /**
     * Show/Hide
     * @type {boolean}
     */
    get shown() {
        return super.shown;
    }

    /**
     * Mode
     * @type {datepicker,monthpicker,yearpicker}
     */
    set mode(value) {
        this._mode = value;
    }

    /**
     * Mode
     * @type {datepicker,monthpicker,yearpicker}
     */
    get mode() {
        return this._mode;
    }

    /**
     * Date value
     * @type {Date}
     */
    get value() {

        let value = this._value;
        if(!value || value == 'Invalid Date') {
            value = Date.Now();
        }

        return value;
    }

    /**
     * Date value
     * @type {Date}
     */
    set value(value) {
        this._value = value.copy();
        this._show();
        this._datePicker.Render();
        this._yearPicker.Render();
        this._monthPicker.Render();
    }

    /**
     * Toggle mode
     */
    ToggleMode() {
        if (this.mode == 'datepicker') {
            this.mode = 'monthpicker';
        } else if (this.mode == 'monthpicker') {
            this.mode = 'yearpicker';
        }
        this._show();
    }

    /**
     * Toggle mode to back
     */
    ToggleModeBack() {
        if (this.mode == 'yearpicker') {
            this.mode = 'monthpicker';
        } else if (this.mode == 'monthpicker') {
            this.mode = 'datepicker';
        }
        this._show();
    }

    /**
     * Show selected mode
     * @private
     */
    _show() {
        if (this.mode == 'datepicker') {
            this._datePicker.shown = true;
            this._yearPicker.shown = false;
            this._monthPicker.shown = false;
        } else if (this.mode == 'monthpicker') {
            this._datePicker.shown = false;
            this._monthPicker.shown = true;
            this._yearPicker.shown = false;
        } else if (this.mode == 'yearpicker') {
            this._datePicker.shown = false;
            this._monthPicker.shown = false;
            this._yearPicker.shown = true;
        }
        this._showPickerTitle();
        if(this.ContainsClass('-up')) {
            this.Dispatch('VisibilityChanged', {state: false});
        }
    }

    /** @private */
    _showPickerTitle() {

        let value = this.value.copy();
        let dateformat = App.DateFormat || 'ru-RU';
        if (this.mode == 'datepicker') {
            const formatter = Intl.DateTimeFormat(dateformat, { month: 'long', year: 'numeric' });
            this._headerText.html(formatter.format(value).replaceAll('г.', ''));
        } else if (this.mode == 'monthpicker') {
            const formatter = Intl.DateTimeFormat(dateformat, { year: 'numeric' });
            this._headerText.html(formatter.format(value));
        } else if (this.mode == 'yearpicker') {
            this._headerText.html(this._yearPicker.startYear + '&nbsp;&ndash;&nbsp;' + (this._yearPicker.startYear + 10));
        }

    }

}

/**
 * @class
 * @extends Colibri.UI.Pane
 * @memberof Colibri.UI
 */
Colibri.UI.DatePicker = class extends Colibri.UI.Pane {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     */    
    constructor(name, container) {
        super(name, container);

        this.AddClass('app-date-picker-component');

    }

    /**
     * Render the component
     * @protected
     */
    Render() {
        this._renderContent();
        this._bind();
    }

    /** @private */
    _renderContent() {

        this._element.html('');
        let dateformat = App.DateFormat || 'ru-RU';
        const formatter = new Intl.DateTimeFormat(dateformat, { day: '2-digit' });
        const weekformatter = new Intl.DateTimeFormat(dateformat, { weekday: 'narrow' });

        const table = this._element.append(Element.fromHtml('<table cellspacing="2"><thead></thead><tbody></tbody><tfoot></tfoot></table>'));

        const thead = table.querySelector('thead');
        const tbody = table.querySelector('tbody');
        const tfoot = table.querySelector('tfoot');

        let tr = thead.append(Element.fromHtml('<tr></tr>'));

        let dt = this.parent.value.copy();
        let checkedDate = dt.copy();

        let today = new Date();

        let weekday = dt.getDay();
        if (weekday == 0) {
            weekday = 7;
        }

        dt.setTime(dt.getTime() - (weekday - 1) * 86400000);
        for (let i = 0; i < 7; i++) {
            tr.append(Element.fromHtml('<td>' + (weekformatter.format(dt)) + '</td>'));
            dt.setTime(dt.getTime() + 86400000);
        }

        dt = this.parent.value.copy();
        let day = dt.getDate();

        dt.setTime(dt.getTime() - day * 86400000);
        weekday = dt.getDay();

        // нашли начало календарика;
        dt.setTime(dt.getTime() - (weekday - 1) * 86400000);

        for (let i = 0; i < 6; i++) {
            // печатаем 6 строк
            tr = tbody.append(Element.fromHtml('<tr></tr>'));
            for (let i = 0; i < 7; i++) {
                // печатаем 7 дней
                let className = "";
                if (today.getDate() == dt.getDate() && today.getMonth() == dt.getMonth()) {
                    className += ' today';
                }
                if (checkedDate.getDate() == dt.getDate() && checkedDate.getMonth() == dt.getMonth()) {
                    className += ' current';
                }
                if (checkedDate.getMonth() != dt.getMonth()) {
                    className += ' ntm';
                }
                tr.append(Element.fromHtml('<td class="' + className + '" data-value="' + (dt.getTime()) + '">' + formatter.format(dt) + '</td>'));
                dt.setTime(dt.getTime() + 86400000);
            }
        }

        tfoot.append(Element.fromHtml('<td colspan="7" data-today="today" data-value="' + (today.getTime()) + '">Oggi</td>'));
    }

    /** @private */
    _bind() {
        this._element.querySelectorAll('td').forEach((td) => {
            td.addEventListener('mousedown', (e) => {
                if (e.target.classList.contains('ntm')) {
                    return false;
                }
                this.parent.value = Date.from(e.target.dataset.value);
                this.parent.parent.value = Date.from(e.target.dataset.value);
                this.parent.parent.Close();
                e.stopPropagation();
                e.preventDefault();
                return false;
            });
        })
    }


}

/**
 * @class
 * @extends Colibri.UI.Pane
 * @memberof Colibri.UI
 */
Colibri.UI.MonthPicker = class extends Colibri.UI.Pane {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     */    
    constructor(name, container) {
        super(name, container);

        this.AddClass('app-month-picker-component');

    }

    /**
     * Render the component
     */
    Render() {
        this._renderContent();
        this._bind();
    }

    /** @private */
    _renderContent() {

        this._element.html('');

        const format = { "month": "short" };
        let dateformat = App.DateFormat || 'ru-RU';
        const formatter = new Intl.DateTimeFormat(dateformat, format);

        const table = this._element.append(Element.fromHtml('<table cellspacing="2"><tbody></tbody><tfoot></tfoot></table>'));
        const tbody = table.querySelector('tbody');
        const tfoot = table.querySelector('tfoot');

        let dt = this.parent.value.copy();

        let checkedDate = dt.copy();
        let today = new Date();

        let currentMonth = today.getMonth() + 1;
        let checkedMonth = checkedDate.getMonth() + 1;

        for (let i = 0; i < 3; i++) {
            let tr = tbody.append(Element.fromHtml('<tr></tr>'));
            for (let month = i * 4 + 1; month <= i * 4 + 4; month++) {

                dt.setMonth(month - 1);

                let className = '';
                if (month == currentMonth) {
                    className = ' today';
                }
                if (month == checkedMonth) {
                    className = ' current';
                }

                tr.append(Element.fromHtml('<td class="' + className + '" data-value="' + (dt.getTime()) + '">' + formatter.format(dt).substring(0, 3) + '</td>'));
            }
        }

        tfoot.append(Element.fromHtml('<td colspan="7" data-today="today" data-value="' + (today.getTime()) + '">Сегодня</td>'));

    }

    /** @private */
    _bind() {
        this._element.querySelectorAll('td').forEach((td) => {
            td.addEventListener('mousedown', (e) => {
                this.parent.value = Date.from(e.target.dataset.value);
                this.parent.parent.value = Date.from(e.target.dataset.value);
                this.parent.ToggleModeBack();
                e.stopPropagation();
                e.preventDefault();
                return false;
            });
        });
    }

}

/**
 * @class
 * @extends Colibri.UI.Pane
 * @memberof Colibri.UI
 */
Colibri.UI.YearPicker = class extends Colibri.UI.Pane {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     */    
    constructor(name, container) {
        super(name, container);
        this.AddClass('app-month-picker-component');
        this.Render();
    }

    /**
     * Render the component
     */
    Render() {
        this._renderContent();
        this._bind();
    }

    /** @private */
    _renderContent() {

        this._element.html('');

        const format = { "year": "numeric" };
        let dateformat = App.DateFormat || 'ru-RU';
        const formatter = new Intl.DateTimeFormat(dateformat, format);

        const table = this._element.append(Element.fromHtml('<table cellspacing="2"><tbody></tbody><tfoot></tfoot></table>'));
        const tbody = table.querySelector('tbody');
        const tfoot = table.querySelector('tfoot');

        let dt = this.parent.value.copy();
        let checkedDate = dt.copy();
        let today = new Date();

        let currentYear = checkedDate.getFullYear();
        let todayYear = today.getFullYear();
        let yearStart = parseInt(currentYear / 10) * 10;

        for (let i = 0; i < 5; i++) {
            let tr = tbody.append(Element.fromHtml('<tr></tr>'));
            for (let year = yearStart + i * 2; year < yearStart + i * 2 + 2; year++) {

                dt.setFullYear(year);

                let className = '';
                if (year == todayYear) {
                    className = ' today';
                }
                if (year == currentYear) {
                    className = ' current';
                }

                tr.append(Element.fromHtml('<td class="' + className + '" data-value="' + (dt.getTime()) + '">' + formatter.format(dt) + '</td>'));
            }
        }

        tfoot.append(Element.fromHtml('<td colspan="7" data-today="today" data-value="' + (today.getTime()) + '">Сегодня</td>'));

    }

    /** @private */
    _bind() {
        this._element.querySelectorAll('td').forEach((td) => {
            td.addEventListener('mousedown', (e) => {
                this.parent.value = Date.from(e.target.dataset.value);
                this.parent.parent.value = Date.from(e.target.dataset.value);
                this.parent.ToggleModeBack();
                e.stopPropagation();
                e.preventDefault();
                return false;
            });
        })
    }

    /**
     * Start year
     * @type {number}
     * @readonly
     */
    get startYear() {
        let dt = this.parent.value.copy()
        let currentYear = dt.getFullYear();
        return parseInt(currentYear / 10) * 10;
    }

}
