/**
 * @class
 * @extends Colibri.UI.Pane
 * @memberof Colibri.UI
 */
Colibri.UI.Popup = class extends Colibri.UI.Pane {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     * @param {*} element element to create in
     */    
    constructor(name, container, element) {
        super(name, container, element);
        this.AddClass('app-popup-component');
        
        this.tabIndex = null;
        this.AddHandler('ShadowClicked', (event, args) => {
            this.Hide();
        });

        this.handleVisibilityChange = true;
        this.AddHandler('VisibilityChanged', (event, args) => {
            if(this.parent && this._positionOnParent) {
                const bounds = this.container.bounds(true, true);
                if(!args.state) {
                    
                    if(this.isComponentWentOutOfRight) {
                        this.right = 0;
                        this.left = null;
                    } else if(this.isComponentWentOutOfLeft) {
                        this.left = 0;
                        this.right = null;
                    } 
                    if(this.isComponentWentOutOfBottom) {
                        this.bottom = 0;
                        this.top = null;
                    } else if(this.isComponentWentOutOfTop) {
                        this.bottom = null;
                        this.top = 0;
                    }
                }
            }
        });

        this._positionOnParent = true;

    }

    /**
     * Float on parent
     * @type {right,left}
     */
    get float() {
        return this._float;
    }
    /**
     * Float on parent
     * @type {right,left}
     */
    set float(value) {
        this._float = value;
    }

    /**
     * Position over parent
     * @type {Boolean}
     */
    get positionOnParent() {
        return this._positionOnParent;
    }
    /**
     * Position over parent
     * @type {Boolean}
     */
    set positionOnParent(value) {
        this._positionOnParent = value;
    }

    /**
     * Show/Hide component
     * @type {boolean}
     */
    set shown(value) {
        value = value === true || value === 'true';
        super.shown = value;

        if(this.parent && this._positionOnParent) {
            this.container.hideShowProcess(() => {
                if(this.parent) {
                    const bounds = this.parent.container.bounds();
                    const thisBounds = this.container.bounds();
                    if(this._float === 'right') {
                        this.top = bounds.top;
                        // this.height = '100%';
                        this.right = bounds.left - thisBounds.outerWidth;
                        this.bottom = null;
                    } else if (this._float === 'left') {
                        this.top = bounds.top;
                        // this.height = '100%';
                        this.left = bounds.left + bounds.outerWidth;
                        this.bottom = null;
                    } else {
                        this.top = this._connectToBody ? (bounds.top + bounds.outerHeight) : bounds.outerHeight;
                        this.bottom = null;
                        if(this._align === 'right') {
                            this.right = this._connectToBody ? (window.innerWidth - (bounds.left + bounds.outerWidth)) : 0;
                        } else {
                            this.left = this._connectToBody ? bounds.left : 0;
                        }    
                        if(this.isComponentWentOutOfRight) {
                            this.right = 0;
                            this.left = null;
                        } else if(this.isComponentWentOutOfLeft) {
                            this.left = 0;
                            this.right = null;
                        } 
                        if(this.isComponentWentOutOfBottom) {
                            this.bottom = 0;
                            this.top = null;
                        } else if(this.isComponentWentOutOfTop) {
                            this.bottom = null;
                            this.top = 0;
                        }
                    }
                    if(value) {
                        this.AddClass(this.parent.name + '-selector-popup');
                        this.BringToFront();
                    } else {
                        this.RemoveClass(this.parent.name + '-selector-popup');
                        this.SendToBack();
                    }    
                }
                this.hasShadow = value;
                this.Dispatch('VisibilityChanged', {state: true});
                
            });
        }

        if(!super.shown && this._connectToBody) {
            this.Disconnect();
            this.ConnectTo(this.parent.container);
            this.hasShadow = value;
        }
    }

    /**
     * Show/Hide component
     * @type {boolean}
     */
    get shown() {
        return super.shown;
    }

    /**
     * Align popup to left or right of parent
     * @type {left,right}
     */
    get align() {
        return this._align;
    }
    /**
     * Align popup to left or right of parent
     * @type {left,right}
     */
    set align(value) {
        this._align = value;
    }

    /**
     * Show popup
     * @param {Colibri.UI.Component} parent parent of popup
     * @param {boolean} connectToBody connect to body
     */
    Show(parent, connectToBody = false) {
        this._connectToBody = connectToBody;
        if(parent) {
            this.parent = parent;
        }
        if(this._connectToBody) {
            this.Disconnect();
            this.ConnectTo(document.body);
            this.namespace = parent.namespace;
            this.container.data('for', parent.path);
        }
        this.shown = true;
    }
    
}

/**
 * @class
 * @extends Colibri.UI.Pane
 * @memberof Colibri.UI
 */
Colibri.UI.SlideDown = class extends Colibri.UI.Pane {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     * @param {*} element element to create in
     */    
    constructor(name, container, element) {
        super(name, container, element);
        this.AddClass('app-component-slidedown-component');
        
        this.tabIndex = null;
        this.AddHandler('ShadowClicked', (event, args) => {
            this.Hide();
        });

    }

    /**
     * Toggle component
     */
    Toggle() {
        this.__handlerClicked();    
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __handlerClicked(event, args) {
        if(this.shown) {
            this.shown = false;
            this.handler.state = 'collapsed';
        } else {
            this.shown = true;
            this.handler.state = 'expanded';
        }
    }


    /**
     * Name of object with is the handler
     * @type {string}
     */
    get handler() {
        return this._handler;
    }
    /**
     * Name of object with is the handler
     * @type {string}
     */
    set handler(value) {
        if(!value && this._handler) {
            this._handler.ClearHandlers();
        }
        this._handler = value;
        if(typeof this._handler === 'string') {
            Colibri.Common.Wait(() => Colibri.UI.Find(this._handler)).then(() => {
                this._handler = Colibri.UI.Find(this._handler);
                if(this._handler) {
                    this._handler.AddHandler('Clicked', (event, args) => this.__handlerClicked(event, args));
                }
            });
        } else {
            this._handler.AddHandler('Clicked', (event, args) => this.__handlerClicked(event, args));
        }
    }



}

/**
 * @class
 * @extends Colibri.UI.FlexBox
 * @memberof Colibri.UI
 */
Colibri.UI.YearQuarterSelector = class extends Colibri.UI.FlexBox {

    /**
     * @constructor
     * @param {string} name name of component
     * @param {Element|Colibri.UI.Component} container container of component
     * @param {Array} values values to show
     */    
    constructor(name, container, values = null) {
        super(name, container);
        this.AddClass('app-component-year-quarter-selector');

        this._values = values;

        this._yearSelector = new Colibri.UI.Selector(this.name + '-year', this);
        this._quarterSelector = new Colibri.UI.Selector(this.name + '-quarter', this);
        this._yearSelector.searchable = false;
        this._yearSelector.readonly = false;
        this._quarterSelector.searchable = false;
        this._quarterSelector.readonly = false;

        this._quartersTexts = [
            '',
            '',
            '',
            '',
        ];
        
        this._yearSelector.shown = true;
        this._quarterSelector.shown = true;

        this._yearSelector.AddHandler('Changed', (event, args) => this.__yearSelectorChanged(event, args));
        this._quarterSelector.AddHandler('Changed', (event, args) => this.__quarterSelectorChanged(event, args));

    }
    
    /** @protected */
    _registerEvents() {
        super._registerEvents();
        this.RegisterEvent('Changed', false, 'Когда значение изменилось');
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __yearSelectorChanged(event, args) {
        const selectedYear = this._yearSelector.value.value;
        
        const quarters = [];
        let selectedQuarter = null;
        for(const period of this._values) {
            if(period.year === selectedYear) {
                selectedQuarter = period.quarters[0];
                for(const quarter of period.quarters) {
                    quarters.push({value: quarter, title: this._quartersTexts[quarter - 1]});
                }
            }
        }

        this._quarterSelector.values = quarters;
        this._quarterSelector.value = selectedQuarter;
        this._value = {year: selectedYear, quarter: selectedQuarter};
        this.Dispatch('Changed', Object.assign(args, {value: this._value}));
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __quarterSelectorChanged(event, args) {
        this._value = {year: this._yearSelector.value.value, quarter: this._quarterSelector.value.value};
        this.Dispatch('Changed', Object.assign(args, {value: this._value}));
    }

    /**
     * Quarters placeholder text
     * @type {String}
     */
    get quarterPlaceholder() {
        return this._quarterSelector.placeholder;
    }
    /**
     * Quarters placeholder text
     * @type {String}
     */
    set quarterPlaceholder(value) {
        this._quarterSelector.placeholder = value;
    }

    /**
     * Years placeholder text
     * @type {String}
     */
    get yearPlaceholder() {
        return this._yearSelector.placeholder;
    }
    /**
     * Years placeholder text
     * @type {String}
     */
    set yearPlaceholder(value) {
        this._yearSelector.placeholder = value;
    }

    /**
     * Array of periods {Number year, Array quarters}
     * @type {Array}
     */
    get values() {
        return this._values;
    }
    /**
     * Array of periods {Number year, Array quarters}
     * @type {Array}
     */
    set values(value) {
        this._values = value;
        this._showValues();
    }
    /** @private */
    _showValues() {
        
        if(!this._values) {
            return;
        }

        const selectedYear = this._value?.year ?? this._values[0].year;
        const selectedQuarter = this._value?.quarter ?? this._values[0].quarters[0];
        
        const quarters = [];
        const years = [];
        for(const period of this._values) {
            years.push({value: period.year, title: period.year});
            if(period.year === selectedYear) {
                for(const quarter of period.quarters) {
                    quarters.push({value: quarter, title: this._quartersTexts[quarter - 1]});
                }
            }
        }

        years.sort((a, b) => a.value > b.value ? -1 : 1);

        this._yearSelector.values = years;
        this._quarterSelector.values = quarters;
        this._yearSelector.value = selectedYear;
        this._quarterSelector.value = selectedQuarter;

    }

    /**
     * Array [year, quarter] or string year-quarter
     * @type {Array|String}
     */
    get value() {
        return this._value;
    }
    /**
     * Array [year, quarter] or string year-quarter
     * @type {Array|String}
     */
    set value(value) {
        this._value = value;
        this._showValue();
    }
    /** @private */
    _showValue() {
        
        if(typeof value === 'string') {
            this._value = this._value.split('-');
        } 

        this._showValues();

    }

}


