App.Modules.Lang.LangTree = class extends Colibri.UI.Tree { 

    /**
     * Render bounded to component data
     * @protected
     * @param {*} data 
     * @param {String} path 
     */
    __renderBoundedValues(data, path) {

        if(!Object.isObject(data)) {
            data = {};
        }

        let found = [];
        Object.forEach(data, (key, lang) => {

            lang.key = key;

            let node = this.FindNode(key);
            if(!node) {
                node = this.nodes.Add(key);
            }
            node.text = lang.desc;
            node.icon = eval(lang.icon);
            node.tag = lang;
            found.push(lang.key);

        });

        this.nodes.ForEach((name, node) => {
            if(found.indexOf(name) === -1) {
                node.Dispose();
            }
        });


    }

}
App.Modules.Lang.LangChangeIcon = class extends Colibri.UI.Icon {
    constructor(name, container) {
        super(name, container);

        this.AddHandler('ContextMenuItemClicked', (event, args) => this.__contextMenuItemClicked(event, args));
        this._savePlace = 'cookie';

        this._iconContextMenu = [];
        this.AddHandler('Clicked', (event, args) => {
            const contextMenuObject = new Colibri.UI.ContextMenu(this.name + '_contextmenu', document.body, this._contextMenuPosition ?? [Colibri.UI.ContextMenu.LB, Colibri.UI.ContextMenu.RB]);
            contextMenuObject.parent = this;
            contextMenuObject.Show(this._iconContextMenu, this);
            contextMenuObject.AddHandler('Clicked', (event, args) => {
                contextMenuObject.Hide();
                this.Dispatch('ContextMenuItemClicked', Object.assign(args, {item: this}));
                contextMenuObject.Dispose();   
            });
        });

    } 

    /**
     * Render bounded to component data
     * @protected
     * @param {*} data 
     * @param {String} path 
     */
    __renderBoundedValues(data, path) {
        if(!data || !Object.isObject(data) || !Object.countKeys(data)) {
            return;
        }

        this._iconContextMenu = [];
        Object.forEach(data, (lang, desc) => {
            this._iconContextMenu.push({
                name: lang,
                title: desc.desc,
                icon: eval(desc.icon)
            });
        });
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __contextMenuItemClicked(event, args) {
        if(args.menuData) {
            if(this._savePlace === 'cookie') {
                Colibri.Common.Cookie.Set('lang', args.menuData.name, 365, '/', location.hostname, true);
            } else if(this._savePlace === 'storage') {
                App.Browser.Set('lang', args.menuData.name);
            }
            location.reload();
        }
    }
    
    /**
     * Context menu position
     * @type {Array}
     */
    get contextMenuPosition() {
        return this._contextMenuPosition;
    }
    /**
     * Context menu position
     * @type {Array}
     */
    set contextMenuPosition(value) {
        value = this._convertProperty('Array', value);
        this._contextMenuPosition = value;
    }

    /**
     * Where to save lang indicator
     * @type {cookie,storage}
     */
    get savePlace() {
        return this._savePlace;
    }
    /**
     * Where to save lang indicator
     * @type {cookie,storage}
     */
    set savePlace(value) {
        this._savePlace = value;
    }

}
App.Modules.Lang.TextsGrid = class extends Colibri.UI.Grid {

    constructor(name, container) {
        super(name, container);
    }
 
    __renderBoundedValues(data, property) {
        if(!data) {
            return;
        }

        if(property.indexOf('lang.langs') !== -1) {
            let column = this.header.columns.Children('key');
            if(!column) {
                column = this.header.columns.Add('key', '');
            }
            let found = ['key'];
            Object.forEach(data, (key, lang) => {
                let column = this.header.columns.Children(key);
                if(!column) {
                    column = this.header.columns.Add(key, lang.desc);
                }
                found.push(key);
                column.viewer = 'Colibri.UI.HtmlDataViewer';
            });

            this.header.columns.ForEach((name, column) => {
                if(name !== 'button-container-for-row-selection' && found.indexOf(name) === -1) {
                    column.Dispose();
                }
            });

        }
        else if(property.indexOf('lang.texts') !== -1) {
            this.rows.title = '';

            let found = [];
            Object.forEach(data, (key, text) => {
                text.key = key;
                let row = this.FindRow(key);
                if(!row) {
                    this.rows.Add(key, text);
                }
                else {
                    row.value = text;
                }
                found.push(key);

            });

            this.ForEveryRow((name, row) => {
                if(found.indexOf(name) === -1) {
                    row.Dispose();
                }
            });

        }
        
    }

    
}
