App.Modules.Sites.FoldersTree = class extends Colibri.UI.Tree {
    
    constructor(name, container) {
        super(name, container);
        this._foldersList = [];
    }

    _findLevel(domain, parent) {
        let ret = [];
        for(const folder of this._foldersList) {
            if(folder?.domain?.id == domain && (folder?.parent?.id ?? 0) == parent) {
                ret.push(folder);
            }
        }
        ret.sort((a, b) => {
            if(a.order > b.order) {
                return 1;
            }
            else if(a.order < b.order) {
                return -1;
            }
            return 0;
        });
        return ret;
    }

    _insertFolderNode(parenNode, folder) {
        let newNode = this.FindNode('folder' + folder.id);
        if(!newNode) {
            newNode = parenNode.nodes.Add('folder' + folder.id);
        }
        newNode.text = folder.description[Lang.Current] ?? folder.description;
        newNode.icon = folder?.published?.value == 1 ? App.Modules.Sites.Icons.FolderIconPublished : App.Modules.Sites.Icons.FolderIconUnpublished;
        newNode.tag = {type: 'page', data: folder};
        return newNode;
    }

    _renderLevel(node, parent, domain) {

        const level = this._findLevel(domain.id, parent);
        for(const folder of level) {


            let newNode = this._insertFolderNode(node, folder);
            if(!folder.parent) {
                newNode.parentNode = this.FindNode('domain' + folder.domain.id);
            }
            else {
                newNode.parentNode = this.FindNode('folder' + folder.parent.id);
            }

            this._renderLevel(newNode, folder.id, domain);

        };

    }


    _renderDomains() {

        for(const domain of this._domainsList) {

            let newNode = this.FindNode('domain' + domain.id);
            if(!newNode) {
                newNode = this.nodes.Add('domain' + domain.id);
            }
            newNode.text = domain.description[Lang.Current] ?? domain.description;
            newNode.icon = App.Modules.Sites.Icons.FolderIconPublished;
            newNode.tag = {type: 'domain', data: domain};

            this._renderLevel(newNode, 0, domain);
    
        }

    }

    _removeUnexistent() {
        this.allNodes.forEach((node) => {
            if(node.tag === null) {
                return true;
            }

            if(node.tag.type === 'domain' && this._domainsList.indexOf(node.tag.data) === -1) {
                node.Dispose();
            }
            else if(node.tag.type === 'page' && this._foldersList.indexOf(node.tag.data) === -1) {
                node.Dispose();
            }
        });
    } 

    /**
     * Render bounded to component data
     * @protected
     * @param {*} data 
     * @param {String} path 
     */
    __renderBoundedValues(data, path) {

        Promise.all([
            Sites.Store.AsyncQuery('sites.domains'),
            Sites.Store.AsyncQuery('sites.pages'),
        ]).then((responses) => {

            let domains = responses[0];
            let data = responses[1];

            if(Object.isObject(domains)) {
                domains = Object.values(domains);
            }

            if(Object.isObject(data)) {
                data = Object.values(data);
            }
    
            this._domainsList = domains;
            this._foldersList = data;
    
            this._renderDomains();
    
            this._removeUnexistent();

        }); 

        

    }
    
}
App.Modules.Sites.DataGrid = class extends Colibri.UI.Grid {

    constructor(name, container) {
        super(name, container);
        this.AddClass('app-manager-datagrid-component');

        this.AddHandler('ColumnClicked', (event, args) => this.__clickOnDataColumn(event, args));        
        this._sortData = {name: '', order: ''};
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __clickOnDataColumn(event, args) {
        this._sortChanged = JSON.stringify(this._sortData) != JSON.stringify({name: this.sortColumn?.name, order: this.sortOrder});
        this._sortData = {name: this.sortColumn?.name, order: this.sortOrder};
    }

    set storage(value) {
        if(value === null) {
            this._storageChanged = true;
            this._storage = null;    
        }
        else {
            this._storageChanged = this._storage?.name != value.name;
            this._storage = value;
        }
    }

    get storage() {
        return this._storage;
    }

    set value(value) {
        this.__renderBoundedValues(value);
    }

    get value() {
        return super.value;
    }

    /**
     * Clear on every change of rows
     * @type {Boolean}
     */
    get clearOnChange() {
        return this._clearOnChange;
    }
    /**
     * Clear on every change of rows
     * @type {Boolean}
     */
    set clearOnChange(value) {
        value = this._convertProperty('Boolean', value);
        this._clearOnChange = value;
    }
    

    /**
     * Render bounded to component data
     * @protected
     * @param {*} data 
     * @param {String} path 
     */
    __renderBoundedValues(data, path) {

        if(!data) {
            data = [];
        }
        else if(Object.isObject(data)) {
            data = Object.values(data);
        }

        if(this._storageChanged) {
            this.ResetSort();
            this.ClearAll();
        }

        if(this._sortChanged) {
            this.ClearAllRows();
            this._sortChanged = false;
        }

        if(this._clearOnChange) {
            this.ClearAllRows();
        }

        if(this._storage && this._storage?.fields && this._storageChanged) {
                
            let idColumn = this.header.columns.Children('id');
            if(!idColumn) {
                idColumn = this.header.columns.Add('id', '#', {width: '5%'});
                idColumn.resizable = true;
                idColumn.sortable = true;
            }
            
            let dateCreatedColumn = this.header.columns.Children('datecreated');
            if(!dateCreatedColumn) {
                dateCreatedColumn = this.header.columns.Add('datecreated', '', {width: '10%'});
                dateCreatedColumn.viewer = 'Colibri.UI.DateTimeViewer';
                dateCreatedColumn.resizable = true;
                dateCreatedColumn.sortable = true;
            }

            if(this._storage.params.softdeletes && this._storage.params.deletedautoshow) {
                let dateDeletedColumn = this.header.columns.Children('datedeleted');
                if(!dateDeletedColumn) {
                    dateDeletedColumn = this.header.columns.Add('datedeleted', '', {width: '10%'});
                    dateDeletedColumn.viewer = 'Colibri.UI.DateTimeViewer';
                    dateDeletedColumn.resizable = true;
                    dateDeletedColumn.sortable = true;
                }   
            }

            const intemplate = {};
            let column = null;
            Object.forEach(this._storage.fields, (name, field, index) => {
                if(field.params?.template === true) {
                    intemplate[name] = field;
                }
                if(field.params?.list !== true) {
                    return true;
                }
                column = this.header.columns.Children(name);
                if(!column) {
                    column = this.header.columns.Add(name, field.desc[Lang.Current] ?? field.desc ?? ''); // , {width: (85/columnCount).toFixed(2) + '%'}
                    if(field.params?.greed) {
                        column.width = field.params?.greed;
                    }
                    if(field.params?.visual) {
                        column.viewer = 'Colibri.UI.HtmlDataViewer';
                    }
                    else if(field.params?.viewer) {
                        column.viewer = field.params?.viewer;
                    }
                    column.tag = field;
                    if(field.params?.render) {
                        column.tag.params = {render: eval(field.params?.render)};
                    }
                    column.resizable = true;
                    column.sortable = true;
                }
                return true;
            });

            if(Object.countKeys(intemplate) > 0) {
                this.rowTemplateComponent = 'App.Modules.Sites.UI.DataGridRowTemplateComponent';
                Object.forEach(this._storage.params.template_args, (key, val) => !val ? (delete this._storage.params.template_args[key]) : null);
                this.rowTemplateAttrs = Object.assign({rows: 'max-content', columns: 3, orientation: 'hr', gap: '0px 0px', flow: 'row'}, this._storage.params.template_args, {fields: intemplate});
            } else {
                this.rowTemplateComponent = null;
            }

            column.resizable = false;

        }

        let found = [];
        data.forEach((d) => {
            found.push('data' + d.id);
            let row = this.FindRow('data' + d.id);
            if(!row) {
                this.rows.Add('data' + d.id, d);
            }
            else {
                row.value = d;
            }
        });

        this.ForEveryRow((name, row) => {
            if(found.indexOf(name) === -1) {
                row.Dispose();
            }
        });

        this.rows.title = '';
        this._storageChanged = false;

    }
}
App.Modules.Sites.PublicationsGrid = class extends Colibri.UI.Grid {
 

    /**
     * Render bounded to component data
     * @protected
     * @param {*} data 
     * @param {String} path 
     */
    __renderBoundedValues(data, path) {

        if(!data) {
            data = [];
        }
        else if(Object.isObject(data)) {
            data = Object.values(data);
        }

        if(data.length == 0) {
            this.ClearAllRows();
        }

        let found = [];
        data.forEach((pub) => {
            found.push('pub' + pub.id);
            let row = this.FindRow('pub' + pub.id);
            if(!row) {
                this.rows.Add('pub' + pub.id, pub);
            }
            else {
                row.value = pub;
            }
        });

        this.DeleteAllExcept(found);

        this.rows.title = '';

        this.rows.Sort((a, b) => {
            return a.value.order > b.value.order ? 1 : -1;
        });

    }

    
}
App.Modules.Sites.StoragesTree = class extends Colibri.UI.Tree {
    
    constructor(name, container) {
        super(name, container);
        this._foldersList = [];

        this.AddHandler('NodeClicked', (event, args) => this.__thisNodeClicked(event, args));

    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __thisNodeClicked(event, args) {
        // if(args.item.tag === 'module') {
        args.item.Expand();
        // }
    }
 

    /**
     * Render bounded to component data
     * @protected
     * @param {*} data 
     * @param {String} path 
     */
    __renderBoundedValues(data, path) {
        if(!data) {
            return;
        }

        if(Object.isObject(data)) {
            data = Object.values(data);
        }

        Manage.Store.AsyncQuery('manage.modules').then((modules) => {
                
            this.nodes.Clear();

            data.forEach((storage) => {

                if(storage?.params?.visible === false) {
                    return true;
                }

                const module = Array.find(modules, 'name', storage.module);
                let moduleNode = this.FindNode(storage.module);
                if(!moduleNode) {
                    moduleNode = this.nodes.Add(storage.module);
                    moduleNode.text = module.desc;
                    moduleNode.tag = 'module';
                    moduleNode.icon = App.Modules.Sites.Icons.ModuleIcon;
                }

                if(storage.group) {
                    const group = (storage.group ? ((storage.group[Lang.Current] ?? storage.group)) : '');
                    let groupNode = moduleNode.nodes.Children(group);
                    if(!groupNode) {
                        groupNode = moduleNode.nodes.Add(group);
                        groupNode.text = group;
                        groupNode.tag = 'group';
                        groupNode.icon = Colibri.UI.FolderIcon;
                    }
                }

            });

            data.forEach((storage) => {

                if(storage?.params?.visible === false) {
                    return true;
                }
                
                const desc = storage.desc[Lang.Current] ?? storage.desc;
                const group = (storage.group ? ((storage.group[Lang.Current] ?? storage.group)) : '');

                let moduleNode = this.FindNode(storage.module);
                let groupNode = group ? moduleNode.nodes.Children(group) : null;

                let newNode = this.FindNode(storage.name);
                if(!newNode) {
                    newNode = (groupNode ? groupNode : moduleNode).nodes.Add(storage.name);
                }
                newNode.text = desc;
                newNode.isLeaf = true;
                newNode.icon = App.Modules.Sites.Icons.StorageIcon;
                newNode.tag = storage;

                return true;

            });
           
        });
       

    }
    
}
App.Modules.Sites.StoragesManagerTree = class extends Colibri.UI.Tree {
    
    

    constructor(name, container) {
        super(name, container);
        this.AddClass('app-manager-tree-component');
        this._foldersList = [];
        this._names = new Map();
        this.removeHiddenNodes = true;
    }

    _searchForFieldIcon(field) {
    
        let icon = '';
        Object.forEach(Colibri.UI.Forms.Field.Components, (name, value) => {
            if(value.className === field.component) {
                icon = value.icon;
            }
        });

        if(!icon) {
            icon = Colibri.UI.FieldIcons['Colibri.UI.Forms.Text'];
        }

        return icon;
        
    }

    _insertModuleNode(module) {
        let moduleNode = this.FindNode(module.name);
        if(!moduleNode) {
            moduleNode = this.nodes.Add(module.name);
            moduleNode.text = module.desc + ' (' + module.name + ')';
            moduleNode.icon = App.Modules.Sites.Icons.ModuleIcon;
            moduleNode.tag.entry = module;
            moduleNode.tag.type = 'module';
            moduleNode.isLeaf = true;
        }
        return moduleNode;
    }

    _insertStorageNode(moduleNode, storage) {
       
        let storageNode = this.FindNode(storage.name);
        if(!storage.params.visible) {
            storageNode.Dispose();
            return null;
        }
        if(!storageNode) {
            storageNode = moduleNode.nodes.Add(storage.name);
        }

        this._names.set(storage.name, storage.name);
        
        const group = (storage.group ? ((storage.group[Lang.Current] ?? storage.group) + ': ') : '');
        const desc = storage.desc[Lang.Current] ?? storage.desc;

        storageNode.text = group + desc + ' (' + storage.name + ')';
        storageNode.isLeaf = Object.countKeys(storage.fields) == 0;
        storageNode.icon = App.Modules.Sites.Icons.StorageIcon;
        storageNode.tag.entry = storage;
        storageNode.tag.type = 'storage';
        storageNode.isLeaf = false;

        this._names.set(storage.name + '_fields', storage.name + '_fields');
        let fieldsNode = this.FindNode(storage.name + '_fields');
        if(!fieldsNode) {
            fieldsNode = storageNode.nodes.Add(storage.name + '_fields');
        }
        fieldsNode.text = '';
        fieldsNode.isLeaf = Object.countKeys(storage.fields) == 0;
        fieldsNode.icon = App.Modules.Sites.Icons.FieldsIcon;
        fieldsNode.tag.entry = null;
        fieldsNode.tag.type = 'fields';
        
        this._insertFieldFields(fieldsNode, storage);

        this._names.set(storage.name + '_indices', storage.name + '_indices');
        let indicesNode = this.FindNode(storage.name + '_indices');
        if(!indicesNode) {
            indicesNode = storageNode.nodes.Add(storage.name + '_indices');
        }
        indicesNode.text = '';
        indicesNode.isLeaf = !storage.indices || Object.countKeys(storage.indices) == 0;
        indicesNode.icon = App.Modules.Sites.Icons.IndexesIcon;
        indicesNode.tag.entry = null;
        indicesNode.tag.type = 'indices';

        this._insertFieldIndexes(indicesNode, storage);


        moduleNode.isLeaf = false;

        return storageNode;
    }

    _insertFieldNode(storageNode, name, field, index) {
        field.name = name;
        this._names.set(storageNode.name + '_' + name, storageNode.name + '_' + name);
        let fieldNode = this.FindNode(storageNode.name + '_' + name);
        if(!fieldNode) {
            fieldNode = storageNode.nodes.Add(storageNode.name + '_' + name, index);
        }
        else {
            storageNode.nodes.Move(fieldNode, index);
        }

        let desc = field.desc;
        try { desc = (field.desc[Lang.Current] ?? field.desc); } catch(e) {}
        if(!desc) {
            desc = '';
        }

        fieldNode.text = desc + 
            ' (' + name + (field?.params?.list ? ', <span class="inlist">inlist</span>' : '') +
            (field?.params?.template ? ', <span class="intemplate">intemplate</span>' : '') + 
            (field?.params?.greed ? ', <span class="greed">' + field?.params?.greed + '</span>' : '') + 
            (field?.params?.viewer ? ', <span class="viewer">' + field?.params?.viewer + '</span>' : '') + 
        ')';

        fieldNode.isLeaf = !field.fields || Object.countKeys(field.fields) == 0;
        fieldNode.icon = this._searchForFieldIcon(field);
        fieldNode.tag.entry = field;
        fieldNode.tag.type = 'field';
        return fieldNode;
    }

    _insertIndexNode(storageNode, name, index) {
        index.name = name;
        this._names.set(storageNode.name + '_' + name, storageNode.name + '_' + name);
        let fieldNode = this.FindNode(storageNode.name + '_' + name);
        if(!fieldNode) {
            fieldNode = storageNode.nodes.Add(storageNode.name + '_' + name);
        }
        fieldNode.text = name + ' (' + index.fields.join(', ') + ', <span class="type">' + index.type + '</span>, <span class="method">' + index.method + '</span>)';
        fieldNode.icon = App.Modules.Sites.Icons.IndexIcon;
        fieldNode.tag.entry = index;
        fieldNode.tag.type = 'index';
        return fieldNode;
    }

    _insertFieldFields(storageNode, storage) {
        if(!storage.fields) {
            return;
        }
        const founds = [];
        Object.forEach(storage.fields, (name, field, index) => {
            const fieldNode = this._insertFieldNode(storageNode, name, field, index);
            founds.push(fieldNode.name);
            this._insertFieldFields(fieldNode, field);
        });

        storageNode.nodes.ForEach((name, node) => {
            if(founds.indexOf(name) === -1) {
                node.Dispose();
            }
        });

    }

    _insertFieldIndexes(storageNode, storage) {
        if(!storage.fields) {
            return;
        }
        Object.forEach(storage.indices, (name, index) => {
            this._insertIndexNode(storageNode, name, index);
        });
    }


    /**
     * Render bounded to component data
     * @protected
     * @param {*} data 
     * @param {String} path 
     */
    __renderBoundedValues(data, path) {
        
        if(!data) {
            return;
        }

        if(Object.isObject(data)) {
            data = Object.values(data);
        }

        this.value = data;

    }

    /**
     * Value Array
     * @type {Array}
     */
    get value() {
        return this._value;
    }
    /**
     * Value Array
     * @type {Array}
     */
    set value(value) {
        this._value = value;
        this._showValue();
    }
    _showValue() {
        
        if(!this._module) {
            this.nodes.Clear();
            return;
        }

        this._value.forEach((storage) => {
            if(storage.module === this._module) {
                this._insertStorageNode(this, storage);
            }    
        });
    }


    /**
     * Module name
     * @type {String}
     */
    get module() {
        return this._module;
    }
    /**
     * Module name
     * @type {String}
     */
    set module(value) {
        this._module = value;
        this.nodes.Clear();
        this._showValue();
    }
    
}
