const Tools = new App.Modules.Tools();

App.Modules.Tools.UI = class {}
App.Modules.Tools.Windows = class {}
App.Modules.Tools.UI.BackupLog = class extends Colibri.UI.Component
{
    constructor(name, container) {
        super(name, container);

        this.AddClass('app-tools-backup-log-component');

        this._close = new Colibri.UI.Icon(this.name + '-close', this);
        this._close.shown = true;
        this._close.value = Colibri.UI.CloseIcon;
        
        const levels = [
            'Emergency',
            'Alert',
            'Critical',
            'Error',
            'Warning',
            'Notice',
            'Informational',
            'Debug'
        ];

        this._list = new Colibri.UI.List(this.name + '-list', this);
        this._group = this._list.AddGroup('group');
        this._list.__renderItemContent = (itemData, item) => {
            return levels[itemData.level] + ': ' + itemData.message;
        };
        this._list.shown = true;

        this._close.AddHandler('Clicked', (event, args) => this.__closeClicked(event, args));

    }

    Add(message) {
        this._group.AddItem(message);
    }

    /**
     * @private
     * @param {Colibri.Events.Event} event event object
     * @param {*} args event arguments
     */ 
    __closeClicked(event, args) {
        this._group.Clear();
        this.Hide();
    }

}
App.Modules.Tools.SettingsTree = class extends Colibri.UI.Tree {
    
    constructor(name, container) {
        super(name, container);
        this.AddClass('app-settings-tree-component');
    }
 

    /**
     * Render bounded to component data
     * @protected
     * @param {*} data 
     * @param {String} path 
     */
    __renderBoundedValues(data, path) {
        if(!data) {
            this.nodes.Clear();
            return;
        }

        if(Object.isObject(data)) {
            data = Object.values(data);
        }

        if(data.length == 0) {
            this.nodes.Clear();
        }

        let rootNode = this.FindNode('root');
        if(!rootNode) {
            rootNode = this.nodes.Add('root');
        }
        rootNode.text = '';
        rootNode.isLeaf = false;
        rootNode.icon = App.Modules.Tools.Icons.SettingsRootIcon;
        rootNode.tag = null;
        rootNode.Expand();

        Manage.Store.AsyncQuery('manage.storages(settings)').then((settings) => {

            let found = [];
            data.forEach((setting) => {
    
                let newNode = this.FindNode(setting.name);
                if(!newNode) {
                    newNode = rootNode.nodes.Add(setting.name);
                }
                newNode.text = setting.name;
                newNode.isLeaf = true;

                const type = Array.find(settings.fields.type.values, 'value', setting.type.value);
                const icon = eval(type.icon);

                newNode.icon = icon;
                newNode.tag = setting;
                newNode.editable = true;

                found.push(setting.name);
    
                return true;
    
            });

            this._removeUnexistent(found);


        });

    }

    _removeUnexistent(found) {
        this.allNodes.forEach((node) => {
            if(node.tag === null) {
                return true;
            }
            if(found.indexOf(node.tag.name) === -1) {
                node.Dispose();
            }
        });
    }

    AddNew(title, type, tag) {
        const rootNode = this.FindNode('root');
        const node = rootNode.nodes.Add('new');
        node.text = title;
        node.isLeaf = true;
        node.icon = eval(type.icon);
        node.tag = tag;
        return node;
    }
    
}
App.Modules.Tools.NoticesTree = class extends Colibri.UI.Tree {
    
    constructor(name, container) {
        super(name, container);

        this.RegisterEvent('NodesLoaded', false, 'Когда все узлы загружены');
    }
 

    /**
     * Render bounded to component data
     * @protected
     * @param {*} data 
     * @param {String} path 
     */
    __renderBoundedValues(data, path) {
        if(!data) {
            this.nodes.Clear();
            return;
        }

        if(Object.isObject(data)) {
            data = Object.values(data);
        }

        if(data.length == 0) {
            this.nodes.Clear();
        }
        let found = [];
        for(const notice of data) {

            let newNode = this.FindNode('notice' + notice.id);
            if(!newNode) {
                newNode = this.nodes.Add('notice' + notice.id);
            }
            newNode.text = notice.name;
            newNode.isLeaf = true;
            newNode.icon = Colibri.UI.MessageEnvelopeIcon;
            newNode.tag = notice;

            found.push('notice' + notice.id);



        }

        this._removeUnexistent(found);

        this.Dispatch('NodesLoaded');

    }

    _removeUnexistent(found) {
        this.allNodes.forEach((node) => {
            if(node.tag === null) {
                return true;
            }
            if(found.indexOf('notice' + node.tag.id) === -1) {
                node.Dispose();
            }
        });
    }

    AddNew(title, tag) {
        const node = this.nodes.Add('new');
        node.text = title;
        node.isLeaf = true;
        node.icon = Colibri.UI.MessageEnvelopeIcon;
        node.tag = tag;
        return node;
    }
    
}
App.Modules.Tools.BucketsTree = class extends Colibri.UI.Tree {
    
    constructor(name, container) {
        super(name, container);
        this.AddClass('app-buckets-tree-component');
    }
 

    /**
     * Render bounded to component data
     * @protected
     * @param {*} data 
     * @param {String} path 
     */
    __renderBoundedValues(data, path) {
        if(!data) {
            this.nodes.Clear();
            return;
        }

        if(Object.isObject(data)) {
            data = Object.values(data);
        }

        if(data.length == 0) {
            this.nodes.Clear();
        }

        let found = [];
        data.forEach((bucket) => {

            let newNode = this.FindNode(bucket.token);
            if(!newNode) {
                newNode = this.nodes.Add(bucket.token);
            }
            newNode.text = bucket.name;
            newNode.isLeaf = true;
            newNode.icon = App.Modules.Sites.Icons.BucketIcon;
            newNode.tag = bucket;

            found.push(bucket.token);

            return true;

        });

        this._removeUnexistent(found);

    }

    _removeUnexistent(found) {
        this.allNodes.forEach((node) => {
            if(node.tag === null) {
                return true;
            }
            if(found.indexOf(node.tag.token) === -1) {
                node.Dispose();
            }
        });
    }

    AddNew(title, type, tag) {
        const rootNode = this.FindNode('root');
        const node = rootNode.nodes.Add('new');
        node.text = title;
        node.isLeaf = true;
        node.icon = eval(type.icon);
        node.tag = tag;
        return node;
    }
    
}
