App.Modules.Tools.VarsGrid = class extends Colibri.UI.Grid {

    constructor(name, container) {
        super(name, container);
        this.AddClass('app-backups-grid-component');
    } 

    /**
     * Render bounded to component data
     * @protected
     * @param {*} data 
     * @param {String} path 
     */
    __renderBoundedValues(data, path) {
        if(!data) {
            return;
        }
        else if(Object.isObject(data)) {
            return;
        }
        
        this.rows.title = '';
        
        let found = [];
        data.forEach((d) => {
            found.push('data' + d.name);
            let row = this.FindRow('data' + d.name);
            if(!row) {
                row = this.rows.Add('data' + d.name, {});
            }

            let viewer = null;
            if((d.type.value || d.type) === 'color') {
                viewer = Colibri.UI.ColorViewer;
            }
            else if((d.type.value || d.type) === 'border') {
                viewer = Colibri.UI.BorderViewer;
            }
            else if((d.type.value || d.type) === 'font-family') {
                viewer = Colibri.UI.FontFamilyViewer;
            }
            else if((d.type.value || d.type) === 'size') {
                viewer = null;
            }
            else if((d.type.value || d.type) === 'image') {
                viewer = Colibri.UI.ImageViewer;
            }
            else if((d.type.value || d.type) === 'shadow') {
                viewer = Colibri.UI.ShadowViewer;
            }

            row.Cell('value').viewer = viewer;
            row.value = d;

        });

        this.ForEveryRow((name, row) => {
            if(found.indexOf(name) === -1) {
                row.Dispose();
            }
        })

    }

}
App.Modules.Tools.DomainsAndThemesTree = class extends Colibri.UI.Tree {
    
    constructor(name, container) {
        super(name, container);

        this.RegisterEvent('NodesLoaded', false, 'Когда все узлы загружены');
    }


    __renderBoundedValues(data, binded) {

        if(binded.indexOf('domainkeys') !== -1) {

            if(!data) {
                this.nodes.Clear();
            }

            if(Object.isObject(data)) {
                data = Object.values(data);
            }

            if(data.length == 0) {
                this.nodes.Clear();
            }

            let found = [];
            for(const domainkey of data) {
    
                let newNode = this.FindNode('domainkey' + domainkey.value);
                if(!newNode) {
                    newNode = this.nodes.Add('domainkey' + domainkey.value);
                }
                newNode.text = domainkey.title;
                newNode.isLeaf = true;
                newNode.icon = App.Modules.Sites.Icons.FolderIconPublished;
                newNode.tag = {type: 'domain', data: domainkey};
    
                found.push('domainkey' + domainkey.value);
    
            }

            this._removeUnexistent(found, 'domainkey');

        }
        else if(binded.indexOf('themes') !== -1) {
            
            if(!data) {
                for(const node of this.nodes.Children()) {
                    node.nodes.Clear();
                }
            }

            if(Object.isObject(data)) {
                data = Object.values(data);
            }

            if(data.length == 0) {
                for(const node of this.nodes.Children()) {
                    node.nodes.Clear();
                }
            }

            let found = [];
            for(const theme of data) {

                theme.value = theme.id;

                const domainNode = this.FindNode('domainkey' + theme.domain);
                if(!domainNode) {
                    continue;
                }
    
                let newNode = this.FindNode('theme' + theme.id);
                if(!newNode) {
                    newNode = domainNode.nodes.Add('theme' + theme.id);
                }
                newNode.text = theme.desc ? theme.desc : theme.name;
                newNode.isLeaf = true;
                newNode.icon = theme.current ? App.Modules.Tools.Icons.ThemesCurrentIcon : App.Modules.Tools.Icons.ThemesIcon;
                newNode.tag = {type: 'theme', data: theme};
    
                found.push('theme' + theme.id);
    
            }

            this._removeUnexistent(found, 'theme');


        }



        this.Dispatch('NodesLoaded');

    }

    _removeUnexistent(found, type) {
        this.allNodes.forEach((node) => {
            if(node.name.indexOf(type) === 0 && found.indexOf(type + node.tag.data.value) === -1) {
                node.Dispose();
            }
        });
    }

    AddNew(domainNode, title, tag) {

        domainNode.Expand();
        
        const node = domainNode.nodes.Add('new');
        node.text = title;
        node.isLeaf = true;
        node.icon = App.Modules.Tools.Icons.ThemesIcon;
        node.tag = tag;

        return node;
    }
    
}
