App.Modules.YerevanParking.Layers.PaymentPage = class extends Colibri.UI.FlexBox {
    
    constructor(name, container) {
        /* создаем компонент и передаем шаблон */
        super(name, container, Colibri.UI.Templates['App.Modules.YerevanParking.Layers.PaymentPage']);
        this.AddClass('app-modules-yerevanparking-layers-paymentpage');
        this.AddClass('app-layer-component');

        this._form = this.Children('container/content/form');
        this._spanCard = this.Children('container/content/span-card');
        this._spanSms = this.Children('container/content/span-sms');
        this._spanWallet = this.Children('container/content/span-wallet');
        this._save = this.Children('container/content/save');
        
        this._save.AddHandler('Clicked', (event, args) => this.__saveClicked(event, args));
        this._form.AddHandler('Changed', (event, args) => this.__formChanged(event, args));

        this.AddHandler('Shown', (event, args) => this.__thisShown(event, args));
        
    }

    __thisShown(event, args) {
        YerevanParking.Store.AsyncQuery('yerevan-parking.settings').then(settings => {
            this._form.value = {
                payment_type: settings.session?.settings?.payment_type ?? null,
                autosms: settings.session?.settings?.autosms ?? false,
                sendsms: settings.session?.settings?.sendsms ?? false
            };
        });
    }

    __formChanged(event, args) {
        const type = this._form.value.payment_type;
        if((type?.value ?? value) === 'sms') {
            this._spanSms.shown = true;
            this._spanCard.shown = false;
            this._spanWallet.shown = false;
        } else if((type?.value ?? value) === 'wallet') {
            this._spanSms.shown = false;
            this._spanCard.shown = false;
            this._spanWallet.shown = true;
        } else if((type?.value ?? value) === 'card') {
            this._spanSms.shown = false;
            this._spanCard.shown = true;
            this._spanWallet.shown = false;
        }

        this._save.enabled = true;
        
    }

    __saveClicked(event, args) {
        const type = this._form.value.payment_type;
        if((type?.value ?? value) === 'sms') {
            try {
                App.Device.Sms.RequestPermission().catch((response) => {
                    console.log(response);
                });
            } catch(e) {}
        }
        YerevanParking.SavePaymentType(
            (this._form.value.payment_type?.value ?? this._form.value.payment_type),
            this._form.value.autosms,
            this._form.value.sendsms
        );
    }

}
